INSERT INTO `board` VALUES (1,1,'어노니머스 프로젝트 보고 온 후기!','daon','오랜만에 그라운드 시소 서촌점에 사진전 보러 갔다 왔어요.\r\n \r\n주말 오후였지만 많이 붐비지 않고 살짝 여유 있게 관람했습니다. \r\n\r\n사진들이 따듯한 느낌으로 보고 있으면 마음이 편안해졌어요. \r\n\r\n층 별로 구성을 달리 해서 보는 맛도 있었고,\r\n중간 중간 포토존이 있어서 좋더라구요! \r\n\r\n평일에 보면 주말보다는 더 여유롭게 감상할 수 있을 듯 해요!','2023. 3. 29 오전 10:18:43',30,'1123',1,0,0),(2,2,'Slick 전시회 다녀왔는데','dayoung','가족들이랑 보러오기 좋은 전시회 같아요!&#129392;&#129392;\r\n\r\n그림이 아기자기 귀엽고 섬세해요! \r\n\r\n사진도 잘 나오고 추억쌓기 좋은 전시인 것 같습니다. ㅎㅎ\r\n\r\n만족도 100입니다!\r\n\r\n기간만 길면 나중에 또 한 번 오고 싶어요!!','2023. 3. 29 오전 10:33:59',28,'2222',2,0,0),(3,3,'맥스 달튼 작품을 보고와서','고독한예술가','세계적인 일러스트레이터 맥스 달튼의 작품들을 만나볼 수 있는 전시예요\r\n\r\n특히 기획력을 인정받은 63아트 미술관에서 개최한 행사로 믿고 보는 전시랄까요? 다채로운 포토존도 있어서 관람하는 재미가 쏠쏠했답니다 ㅎㅎ\r\n\r\n영화 덕후라면 한 번쯤 다녀오시는 걸 추천합니다!! 8~90년대 헐리우드 영화, SF 영화, 음악 영화 등 볼거리도 많고 주제도 좋아서 정말 만족스러웠어요~','2023. 4. 3 오후 3:33:26',131,'1111',3,0,0),(4,4,'어둠속의대화 솔직 후기','다다다','먼저 다녀온 친구가 저한테 조금 무섭다고 해서 걱정이 되었는데,\r\n다녀오고 나니 그 무섭다는 말이 뭔지 알 것 같았습니다.\r\n\r\n하지만 많은 것을 깨닫고 오는 길입니다. \r\n정말 뜻깊은 체험이였어요!','2023. 4. 3 오후 3:35:48',22,'1111',4,0,0);
