INSERT INTO `event` VALUES ('전시','A01','영상','마리오 폰테의 트웰브',18000,'투바앤 웨이븐','서울/경기/인천','23.02.11 - 23.09.17','<h1></h1>마리오 폰테는 전시기획자, 프로그래머, 공간 디자이너 그래픽디자이너, 라이팅 디자이너, 비디오 아티스트 등 다양한 분야의 테크니션들이 \r\n협업해 새로운 경험을 제공하는 크리에이션 그룹입니다.<br>\r\n    마리오 폰테의 트웰브 전시는 크리에이션 그룹 [마리오 폰테] 가 \r\n동시대에 살아가는 이들에게 보내는 트렌디한 위로입니다.\r\n    <br><br> &#160;음악 장르가 주는 영감과 감성을 회화, 비디오, \r\n라이팅, 사진, 텍스처 등의 작품으로 12개의 공간에 표현하였고 관람객은 이 순간들을 기록하게 됩니다.\r\n    전시 후반에는 나의 기록들을 \r\n감상하는 포인트도 숨겨져 있습니다. <br><br>\r\n    <h4>문의</h4>\r\n    1544-1657\r\n\r\n\r\n ',NULL,'\nhttps://www.instagram.com/mario_pontes_12/\n ','A0101','\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader. js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1679886297531\" class= \"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	 2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다. \n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\"  src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n  <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	  new daum.roughmap.Lander({\n 		\"timestamp\" : \"1679886297531\",\n 		\"key\" : \"2e84o\",\n 		 \"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>  \n ',NULL,'2023-02-11','2023-09-17'),('전시','A02','회화','맥스 달튼, 영화의 순간들',15000,'아쿠아플라넷63','서울/경기/인천','22.12.09 - 23.10.29','<h1></h1>63아트는 세계적인 일러스트레이터 맥스 달튼의 개인전 맥스 달튼, 영화의 순간들 63은  <br> 2022년 12월 9일부터 2023년 10월 29일까지 개최됩니다.<br>\n      맥스 달튼은 부에노스아이레스에서 태어나 뉴욕에서 \n      활동 중인 일러스트레이터로서, <br>본인이 좋아하는 옛날 영화, 음악, 수집한 \n      오래된 책 등에 영감을 받아 향수를 불러일으키는 <br>빈티지한 색감과 \n      특유의 정돈된 완벽한 구도의 작품으로 표현하였습니다. <br><br>\n      &nbsp;영화의 한 장면을 재해석한 작품뿐\n      아니라 작가의 고유한 예술세계를 형성케 한 취향과 취미가 작품으로 \n      자연스럽게 승화된 LP 앨범커버 시리즈와 그림책 시리즈 등 폭넓은 \n      스펙트럼의 작품세계를 소개합니다. 대중들에게 익숙한 영화 속 장면이나 \n      유명한 뮤지션이 어떻게 맥스 달튼만의 색감, 특유의 구도,  \n      그리고 세계관으로 그려졌는지 발견해보는 재미를 느끼며 작가의  \n      고유한 세계를 탐험해보길 바랍니다.\n       <br><br>\n       <h4>문의</h4>\n       02-567-8878\n     \n     \n    \n    ',NULL,'https://www.63art.co.kr','A0202','\n \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679887654889\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679887654889\",\n  		\"key\" : \"2e85r\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2022-12-09','2023-10-29'),('전시','A03','영상','SLICK : LOUNGE',12500,'GIFC타워 1층','서울/경기/인천','22.11.18 - 23.06.11','<h1></h1>\n  <b>SLICK : LOUNGE</b>는 알마로꼬 전시 브랜드 Slick의 첫 번째 미디어 아트 전시입니다.\n  <br>\n  오늘날 우리는 수많은 미디어를 통해 화면 속 자신의 모습에서 즐거움을 찾고 스스로를 비추어 보며 사랑합니다. 알마로꼬는 여기에 새로운 기술을 더해 색다른 시각으로 나를 바라볼 수 있도록 합니다.\n  <br>\n  SLICK : LOUNGE에서 자신의 가장 반짝이는 순간들을 만들어 보세요.\n  <br><br>\n  <h4 style=color:gray>PROLOGUE</h4>\n  그리스신화 속 나르키소스는 물속에 비친 자신의 모습을 사랑하며 비극적인 이야기의 주인공이 되었습니다.\n  하지만 오늘날 우리는 수많은 미디어를 통해 화면 속에서 자유롭게 자신의 모습을 표현하며 즐거움을 찾고 사랑합니다.\n  SLICK : LOUNGE는 나를 사랑하는 순간의 환상을 공간에 담고, 나와 나를 둘러싼 세상을 Slick한 모습으로 만듭니다.\n  \n    ',NULL,'https://slick.kr/','A0303','\n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679886728351\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679886728351\",\n  		\"key\" : \"2e84w\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2022-11-18','2023-06-11'),('전시','A04','회화','헬가 스텐첼 특별전',15000,'CxC 아트뮤지엄','서울/경기/인천','23.03.04 - 23.06.11','<h2>우리 일상 속 사물을 보고 또 보면 어떤 재미있는 일이 생길까요?</h2>\n     [저에게 집안의 초현실주의란 평범한 것에서 마법같은 일을 찾고, <br> 불완전함에서\n     아름다움을 보고, 그것을 새로운 방식으로 우리의 현실과 연결하는 것입니다.]\n     <br>-Helga Stentzel-<br><br>\n     <h2>별 볼 일 없을수록 흥미롭다! </h2>\n     &nbsp;헬가 스텐첼은 영국 런던에 기반을 두고 활동하고 있는 예술가입니다.\n     일러스트레이션, 사진, 비디오, 스톱모션 애니메이션 등 다양한 매체와 미디어를 활용해\n     작업합니다. 재치 있는 아이디어로 새로운 생명력을 불어넣는 작업을 주로 선보입니다. <br><br>\n    \n     <h2>우리 주변 모든 것이 놀이!</h2>\n     헬가의 손길을 거치면 일상이 초현실이 되고 초현실이 일상이 됩니다.\n     <br>\n     재치있는 아이디어가 톡톡 튀는 유쾌한 작품세계를 만나보세요.\n     <br><br>\n 	<h4>문의</h4>\n 	문의전화: 070-7746-6611\n     \n     ',NULL,'https://www.instagram.com/cxc_art_museum/?hl=ko','A0404','\n  \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679886810696\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679886810696\",\n  		\"key\" : \"2e84y\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2023-03-04','2023-06-11'),('전시','A05','회화','블리스 풀',8000,'스페이스K 서울 미술관','서울/경기/인천','23.03.09 - 23.06.08','<h1></h1>\n 코오롱의 문화예술 나눔공간 <b>스페이스K 서울</b>은 오는 3월 9일부터 6월 8일까지 <br>\n 볼리비아계 미국인 작가 도나 후앙카(Donna Huanca)의 개인전을 개최한다. <br>\n <b>BLISS POOL(블리스 풀)</b>이라는 제목으로 열리는 이번 전시에서 작가는 \n 조각, 설치, 퍼포먼스 등 다양한 매체를 활용해 몰입감 넘치는 종합 예술 공간을 연출한다. <br><br>\n &nbsp;점토, 모래와 같은 천연 재료와 플라스틱, 인조 가죽과 같은 인공 재료를 혼합하여 탄생한 \n 신작 20여점은 인간과 자연에 대한 작가의 관심에서 시작된다. \n 신체와 피부에서 출발한 총체적 연출은 관객의 기억, 감각, 감정을 반응시켜 사회와 자연에 대한 통찰로 이어진다.\n <br><br>\n <h4>문의</h4>\n 02-3665-8918\n    ',NULL,'https://www.spacek.co.kr/index.do','A0505','\n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679886858592\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679886858592\",\n  		\"key\" : \"2e852\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2023-03-09','2023-06-08'),('전시','A06','사진','나탈리 카르푸셴코 포토전',15000,'그라운드 시소 서촌','서울/경기/인천','22.11.25 - 23.06.06','<h1></h1><b>나탈리 카르푸셴코</b>는 카자흐스탄 출신의 사진작가이자 환경 운동가입니다. 그녀는 있는 그대로의 자 속에 내재된 힘에 대한 메시지를 전하는 것을 작업의 주제로 삼으며, 예술 작업뿐만 아니라 환경 운동가, 특히 해양과 고래 보호에 관한 인플루언서로 활동하며 다양한 행보를 이어가고 있습니다.\n<br><br>\n자연과 사람, 동물 등 우리를 둘러싼 세상 모든 것에서 아름다움을 포착하는 젊은 예술가 나탈리 카르푸셴코. <나탈리 카르푸셴코 사진전>은 그녀가 세계 각지의 섬과 바다를 누비며 기록한 사진 200여 점을 국내 최초로 선보입니다.\n<br><br>\n그녀는 대자연과 인간의 형상을 뮤즈로, 자연과 인간이 마주하는 경이로운 공존의 순간을 작품에 담습니다. 그리고 그 모든 것을 있는 그대로 바라볼 때 그 아름다움이 지켜질 수 있다고 말하죠. 나탈리의 작품 속에서 아름답고도 원초적인 자연을 느기고, 그 일부로서의 자신을 경험해 보세요.\n<br><br>\n<b>더 넓은 세상, 더욱 큰 무언가와의 연결이 시작될 겁니다.</b>',NULL,'https://groundseesaw.co.kr/','A0606','\n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679886905908\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679886905908\",\n  		\"key\" : \"2e853\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2022-11-25','2023-06-06'),('전시','A07','회화','생동하는 뮤지엄',8000,'스페이스 씨','서울/경기/인천','23.03.02 - 23.06.10','<h1></h1>\n코리아나미술관은 2023년, 개관 20주년을 기념하며 국제적으로 활동 \n중인 중견 작가 신미경을 초청해 《<b>시간/물질: 생동하는 뮤지엄</b>》을 개최합니다. \n2003년 개관 이래, 설립 취지인 ‘온고지신(溫故知新)’의 정신을 따라 코리아나 \n화장박물관은 한국 화장문화의 역사와 유물의 연구를 바탕으로 국내외 전시를 통해, 코리아나미술관은 동시대 미술 내 ‘신체’, ‘여성’, ‘아름다움’ 등의 주제를 탐구하는 다양한 기획전시와 프로그램을 통해 차별화된 정체성을 구축해왔습니다. \n<br><br>\n박물관과 미술관이 한 건물에 공존하는 스페이스 씨의 특수성을 살려 기획된 본 전시는 현대미술과 고미술이라는 이분법적 경계를 허물고, 동양-서양, 고전-현대를 교차시키며 새로운 차원의 의미를 더합니다. 이는 고전의 번역을 통해 새로운 것을 창조해 내고자 하는 작가의 태도와 밀접하게 연결됩니다. <br><br>\n전시 제목에 쓰인 ‘시간’과 ‘물질’은 신미경의 작업과 뮤지엄(museum)을 관통하는 주요 개념으로, 전시에서 뮤지엄 공간은 유물과 작품의 배경으로만 존재하는 것이 아닌, 물질적 실체이자 다차원의 시간과 물질이 공존하는 다층적 구조로 작동합니다.\n<br><br>\n<h4>문의</h4>\n02-2133-2538',NULL,'https://www.spacec.co.kr/','A0707','\n \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679886974989\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679886974989\",\n  		\"key\" : \"2e854\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n \n',NULL,'2023-03-02','2023-06-10'),('전시','A08','회화','The Art of Shadow',15000,'MUSEUM 209','서울/경기/인천','22.11.11 - 23.06.25','<h2>빈센트 발</h2>\n벨기에 출신의 영화감독이자 그림자를 활용한 일러스트레이터인 빈센트 발은 자신을 쉐도우 올로지스트(Shadowologest)라고 소개한다.\n2016년 영화 시나리오 작업을 하다가 우연히 발견한 코끼리 형태의 그림자에 \n약간의 드로잉을 그려 넣으면서 쉐도우올로지스트로서의 그의 새로운 커리어가 시작된다.\n<br><br>\n&nbsp;하지만 그 이름에서 풍기는 무게감과 반대로 그의 작품은 굉장히 아기자기하고 만화적이며, 그의 시시한 농담은 사람들을 피식 웃게 만든다. 감자 깎는 칼에서 그랜드 피아노를, 유리잔에서 바다를 발견하는 그가 가진 이 역설적인 직업명은 사물의 그림자 속에서 그가 발견한 새로운 세상과 묘하게 닮아있다.\n<br><br>\n<h4>문의</h4>\n02-6953-8016',NULL,'https://www.instagram.com/museum209/','A0808','\n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679922868907\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679922868907\",\n  		\"key\" : \"2e8nn\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n  \n \n',NULL,'2022-11-11','2023-06-25'),('전시','A09','회화','고흐, 향기를 만나다',10000,'센티드뮤제','서울/경기/인천','23.03.11 - 23.09.30','<h2>빈센트 반 고흐 : 향기를 만나다</h2>\n마지막까지 예술혼을 불태운 예술가, 고흐의 특별한 이야기와 그림을 소개하고 조향사가 그림에서 영감받아 조향한 향수를 함께 감상할 수 있는 \n전시입니다.\n<br><br>\n<h4>이용 수칙</h4>\n타 관람객에게 피해를 주지 않는 사진 촬영은 가능하나 상업적 용도의 촬영은 불가합니다.\n<br>\n음식물, 음식 쓰레기 반입을 금지합니다.<br>\n갤러리 내/외부 전체 금연구역입니다.<br>\n지나친 소음과 대화 등 타 관람객에게 불편을 주는 행위가 지속될 시 퇴장 조치가 이루어질 수 있습니다.<br>\n전시품을 밀거나 손톱으로 긁는 등 전시품을 훼손하는 경우 손해배상금이 청구됩니다.<br>\n이용 수칙을 지키지 않아 발생하는 퇴장 조치는 환불 사유가 아닙니다.\n<br>\n퇴장 시 재입장은 불가능합니다.\n<br><br>\n\n<h4>문의</h4>\n031-948-7926',NULL,'https://www.instagram.com/scented_musee/','A0909','\n \n   \n   <!-- * 카카오맵 - 지도퍼가기 -->\n   <!-- 1. 지도 노드 -->\n   <div id=\"daumRoughmapContainer1679887067388\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n   \n   <!--\n   	2. 설치 스크립트\n   	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n   -->\n   <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n   \n   <!-- 3. 실행 스크립트 -->\n   <script charset=\"UTF-8\">\n   	new daum.roughmap.Lander({\n   		\"timestamp\" : \"1679887067388\",\n   		\"key\" : \"2e857\",\n   		\"mapWidth\" : \"700\",\n   		\"mapHeight\" : \"330\"\n   	}).render();\n   </script>\n  \n \n \n',NULL,'2023-03-11','2023-09-30'),('전시','A10','회화','에바 알머슨 Andando',20000,'대전엑스포시민광장','대전/세종/충청','23.03.17 - 23.08.27','<h2>에바 알머슨</h2>\n그녀의 세 번째 이야기\n에바 알머슨의 영감이 펼쳐지는, 그녀의 작품 세계로 여러분을 초대합니다!<br><br>\n한국인이 사랑하는 화가 <b>에바 알머슨</b>은 사라고사에서 태어나 바르셀로나를 넘어 세계적인 예술가입니다.\n특히, 한국에서의 인연을 소중하게 생각하는 그녀는 여러분이 보내주었던 사랑에 답하고자 오랜 시간 심혈을 귀울인 작품으로 찾아옵니다.<br><br>\n<h4>문의</h4>\n070-5047-7304\n',NULL,'https://artspace3.com/','A1010','\n  <!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680066212923\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680066212923\",\n		\"key\" : \"2e9dw\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n \n',NULL,'2023-03-17','2023-08-27'),('전시','A11','영상','나의 친애하는 친구들에게',15000,'광주시립미술관','광주/전라','22.11.29 - 23.08.28','<h1></h1>\n요나스 메카스 탄생 100주년을 기념하여 <b>『To All My Dear Friends, 나의 친애하는 친구들에게』</b>를 개최한다. 이번 전시에서는 미국 아방가르드 영화의 거장이자 ‘필름 다이어리’ 방식으로 실험영화사에 새로운 지평을 연 요나스 메카스의 전 생애에 걸친 주요 필름들을 전시한다. 이번 전시는 그가 건네는 많은 영화 이야기들이 친구들에게 보내는 안부편지라는 관점에서 시작된다.<br><br>\n\n더불어 그가 친애했던 동료 예술가들의 많은 기록, 그 중에서 같은 뉴욕의 이주민이자 망명자로서 멀리서 가끔씩은 함께 활동했던 백남준과의 우정에 대해서 새롭게 조명한다. 또한 요나스 메카스와 함께 동시대에 활동했던 플럭서스 예술가들의 이미지가 투사되는 백남준의 [시스틴 채플]이 전시된다.<br><br>\n\n요나스 메카스가 촬영하고 백남준이 함께 출연한 [파괴 사중주]에서부터 플럭서스 예술가들의 일상과 그 예술 활동들이 담겨 있는 [앤디 워홀의 삶의 장면들], [제피로 토르나와 조지 마키우나스의 삶], 그리고 [여행 서사시], 대표작 [월든] 등 그의 주요 필름들이 상영된다. 또한 요나스 메카스와 함께 동시대에 활동했던 플럭서스 예술가들의 이미지가 투사되는 백남준의 [시스틴 채플]이 전시된다.<br><br>\n\n<h4>문의</h4> \n051-746-0055',NULL,'https://www.ymuseum.org/home/','A1111','<!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679928305265\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679928305265\",\n  		\"key\" : \"2e8oe\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n \n',NULL,'2022-11-29','2023-08-28'),('전시','A12','영상','ETERNAL NATURE',20000,'아르떼뮤지엄 여수','광주/전라','22.10.29 - 23.06.30','<h1></h1>\n 아르떼뮤지엄 여수는 디스트릭트가 2021년 여수 엑스포 국제관에서 선보이는 두 번째 몰입형 미디어아트 상설 전시관입니다. 대표적인 해양 관광의 도시 여수에서는 오션(OCEAN)이라는 테마로 여수의 바다와 자연 경관을 포함한 11개의 다채로운 미디어아트 전시가 1,400평의 공간에서 펼쳐집니다.\n <br><br>\n 영원한 자연(ETERNAL NATURE)을 주제로 제작된 작품들은 시각적 강렬함과 더불어 감각적인 사운드 및 품격 있는 향기와 함게 완벽한 몰입 경험을 제공합니다.<br><br>\n 모든 감각의 긴장을 잠시 내려놓고 아르떼뮤지엄 여수가 선사하는 영원한 자연의 공간 속으로 입장해 보세요.\n <br><br>\n <h4>문의</h4>\n 061-663-8008\n',NULL,'https://artemuseum.com/YEOSU','A1212','<!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679932821714\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679932821714\",\n  		\"key\" : \"2e8or\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n  \n \n \n',NULL,'2022-10-29','2023-06-30'),('전시','A13','사진','Unnamed Road',13000,'고은사진미술관','부산/경상','23.03.25 - 23.07.09','<h1></h1>\n고은사진미술관은 이정진의 <b>《Unnamed Road》</b> 전시를 개최합니다. 이 시리즈는 사진가가 〈This Place〉프로젝트에서 이스라엘과 요르단 강 서안지구를 담은 이미지들로부터 만들어졌습니다. <br><br> 지구상에서 손꼽히는 분쟁지역인 이곳에 대한 미디어의 시선은 그 분쟁만큼이나 극단적으로 나뉘어 있습니다. 〈This Place〉는 이에 맞서서 우리에게 현존하는 분쟁 그 너머를 보라고 말합니다. 이를 위해 이정진은 ‘길가의 올리브 나무처럼’ 객관적으로 그 땅을 바라보려 하였으나 만연한 공포와 적대감의 현실에 좌절했다고 고백합니다. 사진가로서 거듭나는 경험 속에 그가 담아낸 ‘이곳 this place’의 황량한 하늘과 땅은, 이정진의 독보적인 질감에 갇힌 박제가 되어 허공에 걸려있습니다.<br><br> 과연 그가 이끄는 ‘이름 없는 길 unnamed road’의 끝에는 분쟁 그 너머의 무언가가 기다리고 있을 것 같습니다.<br><br>\n<h4>문의</h4>\n051-746-0055\n',NULL,'https://www.goeunmuseum.kr/bbs/board.php?bo_table=exhibition&wr_id=217&proc=next','A1313','\n \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679887594097\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679887594097\",\n  		\"key\" : \"2e85q\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n  \n \n',NULL,'2023-03-25','2023-07-09'),('전시','A14','영상','치유의 기술',14000,'부산 뮤지엄원','부산/경상','23.03.26 - 23.06.23','<h1></h1>\n미디어 아트와 현대미술이 융합된 MUSEUM1의 새 전시 <b><치유의 기술></b>은 코로나 시대를 살아가는 지친 현대인들에게 <b>예술을 통한 치유와 위로의 메시지를 전달</b>하고자 합니다.<br><br>\n<b><치유의 기술></b>에는 우리나라를 대표하는 현대 미술가 21인이 참여합니다. 이번 전시는 예술이 지니고 있는 다양한 가치 중에서도 특히 관람객의 사유에 초점을 맞추어 기획되었습니다. 그렇기 때문에 작가들이 언급하는 치유에 대한 메시지와 그것을 집약한 결과물을 찬찬히 따라 걷다 보면 예술과 치유의 본질에 대해서 깨닫게 될 것입니다.<br><br>\n약 6,000인치의 초대형 LED패널에 상영되는 메인 홀의 20여 편의 새로운 미디어 아트는 관람객들에게 감동과 즐거움을 선사할 것입니다.<br><br>\n\n<h4>문의</h4> \n055-731-3302',NULL,'https://museum1.co.kr/','A1414','\n \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679931506527\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679931506527\",\n  		\"key\" : \"2e8op\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2023-03-26','2023-06-23'),('전시','A15','사진','어노니머스 프로젝트',10000,'그라운드 시소 서촌','서울/경기/인천','22.11.25 - 23.06.06','<h1></h1>\r  \r  <b>어노니머스 프로젝트</b>는 디렉터리 슐만이 수집한 80만 장의 컬러 필름 슬라이드 컬렉션입니다. 세상에서 가장 독특한 아마추어 사진 컬렉션이라고도 할 수 있는 이 프로젝트는 1940년대부터 1980년대 주로 미국과 영국에서 이름 모를 이들이 각자의 필름 속에 담은 일상 사진들로 구성되었습니다. 이 사진들은 가족, 친구 또는 연인 등 친밀한 관계에 있는 사람들이 촬영했기에 소중한 순간을 간직하고 싶은 애정이 사진에 온전히 드러납니다.\r  <br><br>\r  여러분이 자라온 시대와 국가는 사진 속 배경과는 다르겠지만 전시를 관람하면서 또 다른 공감대를 형성할 수 있길 바랍니다. 생일 파티나 여행처럼 모두가 한 번쯤은 경험해 봤을 순간의 감정은 같으니까요.\r  \r  \r  \r  <br><br>\r  <h4>문의</h4>\r 1522-1796\r  \r ',NULL,'https://groundseesaw.co.kr/','A1515','\n \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1679886905908\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1679886905908\",\n  		\"key\" : \"2e853\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n \n',NULL,'2022-11-25','2023-06-06'),('전시','A16','사진','어제의 미래',15000,'예술의전당 한가람미술관','서울/경기/인천','22.12.08 - 23.08.02','<h1></h1>\n\n<b>마리아 스바르보바</b> 작품의 특징 중 가장 주목할만한 것은 \n신구(新舊)의 적절한 결합을 통한 놀라운 조화를 만들어낸다는 것이다. \n새로운 것과 오래된 것 사이의 균형을 섬세하게 조절하는 능력으로 관람자로 하여금 \n그녀의 작품에 완전히 몰입할 수 있도록 한다. 이 신구(新舊)의 상호작용은 전시 타이틀인 어제의 미래(FUTURO RETRO)를 짓는 참고자료가 되었다.<br><br>\n그녀의 작품에는 분명히 미래지향적인 무언가가 있다. 아마도 마리아가 시대를 초월한 것으로 간주하는 것은 지난 세기의 건축물일 것이다. 브루탈리즘은 특히 스바르보바에게 문학과 영화의 고전 공상 과학 작품을 상기시킨다. 스바르보바의 작업은 가상의 미래 또는 과거 사람들이 상상한 미래를 반영하는 예술 운동인 레트로퓨쳐리즘과 맥을 같이하고 있다.<br><br>\nMaria의 포스트 모던적 비전은 관객이 인간 경험의 신비, 외로움, 고립에 반응하게끔 강요하는 대화를 대담하게 표현하고 있는데, 그럼에도 불구하고 수성 파스텔에 깊숙이 박혀 있는 그녀의 스타일은 보는 이의 시선으로 하여금 삶의 소박한 아름다움을 지속적인 경외심으로 바꾸는 방식을 제시하고 있다.\n\n<br><br>\n<h4>문의</h4>\n02-580-1300\n',NULL,'https://www.sac.or.kr/site/main/home','A1616','\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1679934484083\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1679934484083\",\n 		\"key\" : \"2e8ot\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n \n',NULL,'2022-12-08','2023-08-02'),('전시','A17','영상','어둠속의대화',33000,'북촌 어둠속의대화','서울/경기/인천','23.05.01 - 23.06.30','<h2>아무것도 보이지 않는 어둠 속이지만\n 상상할 수 있는 모든 것이 존재합니다.</h2><br>\n 아무 소리도 들리지 않을 것 같은 깊은 바닷속에도 수많은 소리들이 존재하듯이 아무것도 보이지 않는 어둠 속이지만 우리가 생각하는 모든 것들이 존재합니다. \n 사람과 사람 사이의 물리적인 관계를 단절시키는 ‘어둠’이라는 극단적인 상황 속에서 시각 이외의 다양한 감각들을 활용한 익숙하지만 낯선, \n ‘진정한 소통의 발견’이라는 발상에서 본 전시는 시작됩니다.<br><br>\n 어둠속의대화에서의 완전한 어둠은 인간이 가진 무한한 상상력을 이끌어내는 매개체입니다.\n 그 특별한 어둠 속의 매개자 ‘로드마스터’와 함께하는 100분 간의 흥미롭고 즐거운 경험을 통해\n 각자가 쌓아온 과거의 경험과 기억을 토대로 무의식 속에 잠재된 창의성을 발현할 수 있을것입니다.<br><br>\n <b>문의</b><br>\n 1877-6145\n \n ',NULL,'https://www.dialogueinthedark.co.kr/2014/bukchon/plan.nhn','A1717','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680426671617\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680426671617\",\n		\"key\" : \"2easq\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-05-01','2023-06-30'),('전시','A18','사진','나를 사랑하는 시간',12000,'롯데백화점 인천점','서울/경기/인천','23.03.31 - 23.05.31','\n<h1></h1>\n이번 전시는 3월 8일 세계 여성의날을 기념해 \n기획한 <리조이스:미술과 여성, 빛을 그리다> 라는 이름으로 다양한 국내 여성 작가들의 \n독창적인 작품세계를 만나는 전시를 3~5월에 걸쳐 개최하고 있으며 \n본점, 잠실점, 인천점, 동탄점에서 연계전시로 펼쳐집니다. <br><br>\n\n자연을 그리며 나를 발견해나가는 4명의 아티스트를 소개합니다. \n세상은 너무나 바쁘고 복잡해서 자신을 돌보는 것조차 힘들어집니다. \n이에 우리는 종종 나 자신을 잊고 살아가게 됩니다. <br><br>\n\n이번 전시에 참여한 곽명주, 박은현, 성다솜, 수연 작가는 서로 다른 삶을 살고 있지만, \n사랑이라는 소중한 감정과 광활한 자연은 작가들에게 끊임없는 영감의 원천입니다.<br><br>\n\n이번 전시를 통해 온전히 <나>를 사랑하는 시간을 가져볼 수 있기를 바랍니다.  <br><br>\n\n<h4>문의</h4>\n032-242-2987\n ',NULL,'https://blog.naver.com/lottegallery_ict','A1818','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681211778840\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681211778840\",\n		\"key\" : \"2eeiv\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n ',NULL,'2023-03-31','2023-05-31'),('전시','A19','영상','에곤실레와 클림트',9000,'홍대 띠아트','서울/경기/인천','23.05.05 - 23.06.31','\n<h1></h1>\n\n불후의 에고이스트, 에곤 실레\n고통과 절망, 구원과 사랑의 세상에서 찾은 진정한 <나>\n\n19세기 후반을 대표하는 표현주의 화가인 에곤 실레가 바라본 세상이 스토리몰입형 미디어아트로 재탄생하였습니다.<br><br>\n\n<나는 그림을 그리는 영원한 아이.\n나를 보라. 내 그림, 내 조각들을.> <br>\n\n2023년 5월,\n혼란의 시대에서 자아를 찾아 헤맸던 에곤 실레의 이야기가 여러분들께 공개됩니다!<br><br>\n\n<h4>문의</h4>\n070-8829-9894\n\n\n\n ',NULL,'https://www.instagram.com/p/Cqryjg_PlVk/','A1919','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681212038082\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681212038082\",\n		\"key\" : \"2eeiy\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n ',NULL,'2023-05-05','2023-06-31'),('전시','A20','영상','로봇별 에디 : 모험의 시작',15000,'국립부산과학관','부산/경상','23.03.30 - 23.07.02','\n<h1></h1>이번 특별기획전은 단순 관람에 초점을 맞춘 기존의 로봇전시와는 달리 관람객과 소통, 교감하는 방식으로 진행되는 스토리텔링형 로봇 체험전이다. <br><br>\n1:1로 매칭된 관람객을 체험 내내 따라다니는 인공지능 로봇 ‘에디’가 그 주인공이다. <br><br>부드러운 촉감과 귀여운 외모로 관람객의 마음을 사로잡을 작은 로봇 에디는 일정 시간동안 관람객의 움직임이 없으면 슬픈 표정과 울음으로 감정을 표현하기도 하는 ‘감성봇’이다.\n<br><br>\n<h4>문의</h4>\n051-750-2300\n',NULL,'https://www.sciport.or.kr/kor/CMS/EventMgr/view.do?mCode=MN121&sitecode=kor&event_code=3966','A2020','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681365301656\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681365301656\",\n		\"key\" : \"2efe3\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-03-30','2023-07-02'),('전시','A21','사진','사적시선',10000,'천안청년센터 갤러리','대전/세종/충청','23.04.10 - 23.06.03','\n<h1></h1>책방, 허송세월에서 처음으로 기획한 ‘사적 시선’ 전시는 상명대학교 사진학과를 졸업한 남영민, 엄우산, 이슬기 작가가 참여한 그룹전이다. 이번 전시는 개인적인 관심으로 시작된 시선이란 공통적인 주제로 인물, 사물, 공간을 엿볼 수 있다.\n\n<br><br>\n<h4>문의</h4>\n0507-1338-2032\n',NULL,'https://www.ch2030youth.kr/bbs/board.php?bo_table=edu_program','A2121','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681366926863\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681366926863\",\n		\"key\" : \"2effa\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-10','2023-06-03'),('전시','A22','사진','사진, 익숙하고 낯선 말들',10000,'아미미술관','대전/세종/충청','23.03.30 - 23.06.20','\n<h1></h1><b>2023 아미의 작가들<br>\n아미미술관 X 시작(sizak)</b><br>\n김준영, 김태중, 김형식, 박선영, 송강효진, 유혜정, 윤태준, 이현우, 장소영<br><br>\n중앙대학교 사진학과를 중심으로 성장하고 있는 시작 그룹을 초대하여 사진의 다양한 면모를 살펴보고자 합니다. <br>\n여기에는 전통적인 방식으로 촬영한 사진은 물론, 카메라 없이 빛과 인화지로 만드는 포토그램, <br>\n다양한 방식으로 기획하여 촬영하거나 합성한 사진, 변화하는 디지털 환경에서 이미지 툴로 재가공 하거나 새로이 창조된 세계,\n또 영상과 상호작용 하는 사진 등 꽤 넓은 영역의 사진을 포함합니다.<br><br>\n\n실제로 얼핏 비슷해 보이는 이미지는 추상적인 감정이 시각화된 결과물이기도 하고 한편\n인간관계에 대한 성찰을 반영하는 등 서로 다른 내용을 보여주기도 합니다.\n\n친숙하지만 한편으로 낯선 세계를 보여주는 이번 전시를 통해<br>\n젊은 사진작가들이 사진이라는 언어로 건네는 메시지를 흥미롭게 감상할 수 있기를 희망합니다.<br><br>\n<h4>문의</h4>\n041-353-1555\n',NULL,'http://amiart.co.kr/posts/3502','A2222','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681539874954\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681539874954\",\n		\"key\" : \"2eg65\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-03-30','2023-06-20'),('전시','A23','사진','랄프 깁슨 : Sacred Land',12000,'랄프깁슨사진미술관','부산/경상','23.04.13 - 23.10.15','\n<h1></h1>\n초현실주의 사진의 거장, 사진가 랄프 깁슨의 역사적 발자취를 품고 있는《Sacred Land》전을 개최합니다.<br><br>\n랄프 깁슨 사진미술관에서 선보이는 《Sacred Land》전은 현대사진의 진정한 의미를 경험할 수 있는 소중한 시간이 될 것입니다. \n랄프 깁슨의 《Sacred Land》은 세계에서 가장 오래된, 그리고 가장 젊은 국가로서 생존을 위해 분투하고 있는 이스라엘을 기록한 사진입니다. \n사진가 랄프 깁슨이 인식한 이스라엘의 유구한 역사와 유대인 디아스포라, 그리고 독특한 석회석 지형과 빼어난 건축 등, 그의 뛰어난 영감으로 표현된 작품 100점을 선보입니다.        \n\n<br><br>활기찬 봄의 정취와 함께 초현실주의 사진가 랄프 깁슨의 또 하나의 사진 세계를 만나보시길 바랍니다.\n<br><br>\n<h4>문의</h4>\n051-747-1939\n',NULL,'http://www.gibsongoeunmuseum.com/bbs/board.php?bo_table=exhibition&wr_id=4&proc=now','A2323','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681543473249\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681543473249\",\n		\"key\" : \"2eg69\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-13','2023-10-15'),('전시','A24','영상','사유정원',15000,'국립아시아문화전당문화창조원','광주/전라','23.02.27 - 23.08.27','\n<h1></h1>\n전시 ≪사유정원, 상상 너머를 거닐다≫는 아시아 고유의 사상과 미(美), 그리고 공간을 탐구함으로써 아시아를 향한 새로운 상상의 지평을 확장합니다. 유교·불교·도교로부터 영향을 받은 동아시아의 문화는 세상의 모든 요소들이 연결되어 순환한다는 전일주의(全一主義)에 기반합니다. \n<br><br>\n≪사유정원, 상상 너머를 거닐다≫에서 새로운 상상을 위한 단서를 보여 주는 창제작 작품들과 함께 노닐고 사유하며 아시아, 그 너머를 그려보기 바랍니다.\n<br><br>\n<h4>문의</h4>\n051-750-2300\n',NULL,'https://scenery-asia.com/','A2424','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681543894021\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681543894021\",\n		\"key\" : \"2eg6a\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-02-27','2023-08-27'),('전시','A25','사진','Inscape',10000,'광주시립미술관','광주/전라','23.04.05 - 23.07.23','\n<h1></h1>\n2023 광주시립사진전시관 첫 초대전으로 1990년대 이후 활발하게 ‘뉴 컬러’ 사진으로 남도의 풍경을 담아온 이주한 작가 초대전시를 개최한다.<br><br>이번 전시는 이주한 작가가 처음으로 컬러 사진을 시도했던 작품부터 최근의 영상 미디어 작업까지 지난 30여 년의 작업 흐름을 한 자리에서 볼 수 있는 전시다. 전시의 초입에는 컬러 사진 초기작인 일본 남항, 호주 에어즈락, 미국 사막의 풍경이 관람객을 맞이하며 작가의 작업세계로 이끈다. 전시는 작가가 귀국 후 남도 일대를 돌아다니며 작업하였던 컬러 풍경 사진 ‘남도(南圖)/남가풍경(南家風景)’, 광주에 정착한 후 오랜 기간 같은 장소에서 무등산을 촬영한 ‘무등산(無等山)’ 연작, 그리고 주제·형식·방법론적 차원에서 새로운 도전을 한 ‘월광산수(月光山水)’라는 세 가지 소주제로 구성된다.<br><br>\n<h4>문의</h4>\n062.613.7100\n',NULL,'https://artmuse.gwangju.go.kr/pj/pjExhibit.php?pageID=artmuse0209000000&action=view&exhiCd=003&exhiTp=N&lang=KOR&eSeq=806','A2525','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681548707776\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681548707776\",\n		\"key\" : \"2eg6j\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-05','2023-07-23'),('전시','A26','회화','미술의 숲',10000,'세종지혜의숲','대전/세종/충청','23.01.26 - 23.06.30','\n<h1></h1>\n지역 상권 활성화를 위해 비어있는 유휴공간을 전시공간으로 탈바꿈 하여 주최하는 전시입니다. <br>\n6개월이라는 기간 동안 세종시민들에게 미술의 향연을 보여드릴 계획으로 개최된 <미술의 숲> 전시입니다. <br>\n작가별, 작품유형별 창작 작품소개 및 지역문화 활성화 기반을 마련해 코로나로 인해 지친 주민들에게 예술을 통한 활력소를 제공하기 위해 마련되었습니다.\n\n<br><br>\n<h4>문의</h4>\n044-862-0021\n',NULL,'http://www.kmcaa.or.kr/','A2626','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681549712189\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681549712189\",\n		\"key\" : \"2eg6p\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-01-26','2023-06-30'),('전시','A27','사진','요시고 포토전',10000,'KT&G 상상마당 부산','부산/경상','23.05.27 - 23.09.03','\n<h1></h1>\n아날로그의 낭만을 사랑하는 스페인 사진작가\n<b>YOSIGO(요시고, 본명 Jose Javier Serrano)</b><br><br>\n2021년 여름, 40만 명의 관람객을 동원하며 서울을 뜨겁게 달군 <요시고 사진전 : 따뜻한 휴일의 기록>이 부산에 찾아옵니다.\n이번 전시에서도 푸른 지중해를 둘러싼 유럽의 휴양지부터 마이애미, 두바이, 부다페스트 등 세계 여러 여행지를 기록한 350여 점의 사진을 만나 보실 수 있습니다.\n\n<br><br>\n<h4>문의</h4>\n070-8893-0910\n\n',NULL,'https://www.sangsangmadang.com/display/detail/2336','A2727','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681550783379\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681550783379\",\n		\"key\" : \"2eg6y\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-05-27','2023-09-03'),('전시','A28','회화','장 줄리앙 여전히, 거기',10000,'우양미술관','부산/경상','23.03.03 - 23.10.05','\n<h1></h1>\n세계적인 아티스트 장 줄리앙은 간결한 선과 색으로 우리 주변의 일상과 사회적 이슈를 참신하고 위트있게 보여준다. \n그는 ‘단순한 형태는 모든 사람이 이해할 수 있다.’라는 믿음 아래 독창적이면서도 만인이 공감할 수 있는 그림체로 작품을 창작한다. \n평면 일러스트에만 국한되지 않고 회화, 영상, 조각, 오브제, 패션 등 장르와 소재를 자유롭게 넘나들며 끊임없는 도전을 보여주고 있다. <br><br>\n2023년 우양미술관에서 『장 줄리앙: 여전히, 거기(Jean Jullien: Still, There)』라는 제목으로 또 다른 작품 세계가 더해서 더욱 풍성한 전시로 선보인다.\n\n<br><br>\n<h4>문의</h4>\n054-745-7075\n\n',NULL,'http://www.wooyangmuseum.org/html/02/2_1.php?mode=read&idx=155&search_select=&keyword=&pagenum=0&year_range=','A2828','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681551911451\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681551911451\",\n		\"key\" : \"2eg74\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n',NULL,'2023-03-03','2023-10-05'),('전시','A29','사진','피크닉 piknic',12000,'피크닉','서울/경기/인천','23.04.06 - 23.07.30','\n<h1></h1>\n2023년 4월, 피크닉이 새로운 전시로 여러분을 초대합니다. <br><br>\n프랑수아 알라르는 안목과 교양이 뛰어난 유명인사, 컬렉터, 예술가들의 사적인 공간을 40여 년간 촬영해온 프랑스 사진작가입니다.\n초창기 작업인 이브 생 로랑의 우아한 거실에서부터 텍사스 사막 한가운데의 도널드 저드 뮤지엄, 레니 크라비츠의 정체성을 드러내는 아파트, \n루이스 바라간의 멕시코 집에 이르기까지, 200여 점의 작품을 통해 알라르가 사랑한 비밀의 공간과 그 이면의 이야기들을 폭넓게 다룹니다. \n불어로 ‘사적인 방문’, ‘은밀한 방문’을 뜻하는 전시 타이틀 ’비지트 프리베‘처럼,\n알라르의 사진이 안내하는 길을 따라 세상에서 가장 사적이고 은밀한, 아름다운 취향의 세계로 여행을 떠나 보세요.\n\n<br><br>\n<h4>문의</h4>\n02-318-3233\n\n',NULL,'http://piknic.kr/','A2929','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681553806389\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681553806389\",\n		\"key\" : \"2eg79\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n',NULL,'2023-04-06','2023-07-30'),('전시','A30','회화','상상력에게',12000,'아미미술관','대전/세종/충청','23.02.10 - 23.06.20','\n<h1></h1>\n유학 생활을 하며 학교 근처에 있는 숲과 나무 사이를 걷는 것을 즐겼다. <br> <br>\n숲에서 볼 수 있는 다양한 녹색들과 알 수 없는 짐승, 자연의 소리들 그리고 특유의 냄새는 자연스럽게 많은 것들을 상상하게 만들어 주었고, \n동시에 위로와 우울함을 직면할 수 있었다.\n그 안에서 느껴지는 평온함과 불안함은 숲 밖의 세상과 인간관계에서 얻게 되는 감정들과 닮아있었다.  <br><br>\n그 속에서 존재하지 않는 나만의 온전한 세상을 상상하고 나의 세계를 꿈꾸었다. \n숲이라는 대상을 통해서 내가 바라보는 사람들과 세상에 관한 이야기를 풀어나간다.\n<br><br>\n<h4>문의</h4>\n041-353-1555\n\n\n',NULL,'http://amiart.co.kr/posts/3499?_publicationState=preview','A3030','\n\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1681539874954\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1681539874954\",\n 		\"key\" : \"2eg65\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n \n\n',NULL,'2023-02-10','2023-06-20'),('전시','A31','회화','리틀포레스트展',20000,'해동문화예술촌','광주/전라','23.03.04 - 23.08.27','\n<h1></h1>\n이번 전시는 기존의 자연적인 구성물(식물)이 아닌 인공적인 구성물로 만들어진 상황에서 아름다움을 마주할 때 우리가 느끼는 ‘자연’의 의미는 어떤 것일까? 라는 물음에서 시작됐다. <br><br>\n\n용도를 다해 버려진 폐기물(플래카드)에 생명력을 불어넣어 새로운 생명체(꽃)를 탄생시키는 작업을 지속해온 윤종호는 인공물과 자연, 즉 죽어있는 것과 살아있는 것의 화합을 통해 하나의 세계를 구현한다. <br><br>\n\n인공물, 자연, 예술이 결합된 미묘한 공간에서 어린이들은 각자의 감상법과 상상력을 통해 자연을 감상하고, 그 안에서 새로운 자연의 이미지를 탐구할 수 있을 것이다. <br><br>\n<h4>문의</h4>\n061-383-8241\n\n\n',NULL,'https://www.damyangcf.or.kr/user','A3131','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681631281092\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681631281092\",\n		\"key\" : \"2eg9c\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n \n\n',NULL,'2023-03-04','2023-08-27'),('전시','A32','영상','생태, 인류, 담양 展',10000,'해동문화예술촌','광주/전라','23.03.10 - 23.08.28','\n<h1></h1>\n본 전시를 위해 지역 외부의 작가와 기획자가 담양을 제3의 시선으로 바라보고 지역의 특색을 탐구했습니다.<br><br>\n\n전라남도 담양군은 죽녹원과 관방제림, 메타세콰이어 가로수길 등 자연의 정취를 오롯이 간직한 지역입니다.\n\n이러한 특성에 맞춰 참여작가들은 지역을 답사하고 연구하여 현장설치, 미디어아트, 회화, 사진 등 다채로운 장르로 작품을 제작했습니다.\n\n예술가의 상상으로 생태적 풍경을 만들고, 소리와 향 등 감각을 통해 자연과 교감하며, 자본주의와 기술개발의 인류적 상황 속에서 자연의 중요성을 성찰할 수 있도록 하였습니다.\n\n <br><br>본 전시가 국내 예술자원이 수도권에 가중된 상황에서 동시대미술의 시류를 소개하고 문화적 인프라를 확장하여 지역과 교류하는 기회가 되길 기대합니다.\n<br><br>\n <h4>문의</h4>\n061-381-8240\n\n\n',NULL,'https://www.damyangcf.or.kr/user','A3232','\n\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1681631281092\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1681631281092\",\n 		\"key\" : \"2eg9c\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n  \n \n \n\n\n',NULL,'2023-03-10','2023-08-28'),('전시','A33','영상','별별 바다神',12000,'국립해양박물관','부산/경상','23.03.28 - 23.08.20','\n<h1></h1>\n우리나라 사람들은 광활한 대자연인 ‘바다’와 삶과 죽음, 희로애락을 함께 해왔다. 때로는 텅 빈 어장과 거친 풍랑으로 별별 아픔을 겪었지만 이 또한 바다를 무대로 살아가는 사람들의 숙명이라고 여겼다.<br><br>\n\n이번 전시에서는 풍요와 재난이 공존하는 미지의 공간인 바다에서 선조들의 삶과 함께한 별별 바다신과 이들을 모셨던 각종 의례를 소개하고자 한다.\n\n생업을 위해 바다로 떠나보내는 염원을 축제로 승화시킨 바닷사람들의 생생한 삶을 보면서 우리의 전통 신앙을 되새겨보고 바닷사람들의 삶과 문화를 느낄 수 있는 시간이 되었으면 한다.\n\n아울러, 바다가 어떻게 치유와 살림, 생명의 공간이 되는지를 함께 공감하는 계기가 되기를 기원한다.\n\n<br><br>\n <h4>문의</h4>\n051-309-1900\n\n \n\n\n',NULL,'https://www.mmk.or.kr/?folder=exhibition&page=view&idx=75&cate=now_upcoming','A3333','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681633934127\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681633934127\",\n		\"key\" : \"2eg9e\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n \n\n\n',NULL,'2023-03-28','2023-08-20'),('전시','A34','사진','애도 : 상실의 끝에서',15000,'전남도립미술관','광주/전라','23.03.30 - 23.09.12','\n<h1></h1>\n코로나바이러스-19로 인한 감염증과 수많은 사망자들, 기후 위기로 진화가 어려운 산불, 전쟁으로 설 곳을 잃은 사람들. 우리 모두 상실의 시대를 살고 있다. 전남도립미술관은 우리를 관통하는 상실과 이를 극복하기 위한 애도의 과정을 추적하기 위해 전시를 마련했다. 과거의 충격이 현재로 이어지는 트라우마의 경험은, 심리적 고통을 극복하기 위한 승화의 과정으로 이어진다. 이번 전시에서 소개하는 작가들의 작품 또한 이러한 상실의 과정을 애도하고, 현재를 살아가기 위한 승화의 결과물이다.<br><br>\n 상실의 끝에는 무엇이 남을까. 당신은 무엇을 잃었는가. 무엇에 애착을 가졌나. 무엇을 떠나보낼 수밖에 없었나. 그것들이 떠난 자리는 무엇으로 채워졌나. 애도는 과거에 관한 일일까, 미래에 관한 일일까. 이러한 질문들의 해답을 찾을 수 없더라도 끊임없이 곱씹는 작가들의 결과물을 착실히 들여다보면서, 전시장을 나서는 순간에는 희미한 느낌표가 생기기를 기대한다.<br><br>\n <h4>문의</h4>\n061-760-3290\n\n\n\n',NULL,'https://artmuseum.jeonnam.go.kr/museumofart/index.do','A3434','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681635085232\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681635085232\",\n		\"key\" : \"2eg9j\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n',NULL,'2023-03-30','2023-09-12'),('전시','A35','사진','역사가 된 찰나',15000,'전남도립미술관','광주/전라','23.02.06 - 23.06.18','\n<h1></h1>\n사진가 이경모는 1926년 전남 광양에서 태어나 20세의 나이에 호남신문사(현 광주일보의 전신)의 사진부장으로 보도사진 촬영을 시작하여 타계 1년 전인 2000년 말까지 약 55년 동안 한국 근현대사 격동기의 현장 및 전국 각지의 풍경과 문화재, 일상을 살아가는 사람들의 모습을 사진으로 남겼다.\n<br><br>\n해방 이후부터 여순사건, 6.25 전쟁까지 한국 근현대사 비극의 한 가운데에서, 이경모는 자신만의 고유한 시각으로 이념의 대립과 민족상잔의 현장을 꼼꼼하게 사진기에 담았다. 광양의 유당공원 사진을 비롯하여 전국 방방곡곡을 담은 풍경사진은 그의 사진이 지닌 미학적이고 예술적인 측면을 직관적으로 보여준다.<br><br>\n <h4>문의</h4>\n061-760-3290\n\n\n',NULL,'https://artmuseum.jeonnam.go.kr/museumofart/index.do','A3535','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681635085232\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681635085232\",\n		\"key\" : \"2eg9j\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n',NULL,'2023-02-06','2023-06-18'),('전시','A36','사진','남원, 달빛에 물들다',10000,'남원시립김병종미술관','광주/전라','23.02.24 - 23.07.27','\n<h1></h1>\n이 사진전은 올해 남원시립김병종미술관의 마지막 기획 전시다. 이흥재 작가는 ‘남원, 달빛에 물들다’를 주제로 남원의 역사적 배경이 되는 곳곳의 풍경 사진뿐만 아니라, ‘남원’이라는 공간에서 살아온 사람들의 이야기도 함께 담았다.<br><br>\n전시는 크게 두 가지 주제로 나뉘어져 있다. 1부에서는 달빛 아래 드러난 남원의 사적지와 명승지를, 2부에서는 청색 어둠에 물든 지리산의 몽환적인 풍광을 볼 수 있다. 밤하늘 아래 푸르스름하게 빛나는 지리산 능선의 모습을 4ｍ 이상의 대작으로 담아내 관람객의 탄성을 자아내기도 했다.<br><br>\n <h4>문의</h4>\n063-620-5660\n\n',NULL,'https://nkam.modoo.at/','A3636','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681636816279\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681636816279\",\n		\"key\" : \"2eg9q\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-02-24','2023-07-27'),('전시','A37','영상','그림은 자연같이',10000,'대전시립미술관','대전/세종/충청','23.03.04 - 23.06.12','\n<h1></h1>\n<그림은 자연같이>는 자연과 예술의 친연성을 주제로 자연과 예술의 관계를 조망하는 전시이다. \n그림도 그렇듯이 시도 그렇다는 의미의 라틴어 구절인 <Ut pictura poesis>의 의도와 해석을 레퍼런스 삼아 자연과 예술의 일치성과 경중의 차이를 살펴본다. \n이번 전시는 제니퍼 스타인캠프의 영상미디어를 소개하며 도시의 혼잡으로부터 치유와 사색의 안식처를 제공하고자 한다. <br><br>\n제니퍼 스타인캠프의 애니메이션은 미적 우아함과 숙달된 기술의 뛰어난 조합이다. 그러나 기술은 뒤로하고 이미지의 순수한 아름다움을 느껴보자. \n과학, 역사, 기억을 넘어 자연을 새롭게 인식하는 경험을 선사할 것이다. <br><br>\n<h4>문의</h4>\n042-270-7378\n',NULL,'https://www.daejeon.go.kr/dma/index.do','A3737','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681742460134\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681742460134\",\n		\"key\" : \"2egth\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-03-04','2023-06-12'),('전시','A38','사진','멀리 새벽으로부터',10000,'포항시립미술관','부산/경상','23.04.06 - 23.06.12','\n<h1></h1>\n지역작가조망전 김재동 《멀리 새벽으로부터: 1970-1990년대 포항 기록》은 \n포항 토박이로서 고향의 삶의 모습을 사진으로 기록한 김재동의 시선을 보여준다. \n작가는 1970년대부터 포항 교외 곳곳을 다니며, 생업에 종사하는 노동자들의 모습을 카메라에 담았다. <br><br>\n이번 전시는 “인간의 삶”, “사건의 목격자”, “장면 속 인물”, “무조(舞鳥)” 네 가지 섹션으로 나뉘어 펼쳐진다. <br><br>노동의 현장에서 포착한 인간의 희로애락, \n다큐멘터리 사진가이자 관찰자의 눈으로 바라본 세상, \n고향 포항에서 흔히 볼 수 있는 갈매기의 모습 등 김재동의 사진에서 그가 나고 자란 땅에 대한 애정을 엿볼 수 있다.\n',NULL,'https://poma.pohang.go.kr/poma','A3838','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681747252828\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681747252828\",\n		\"key\" : \"2egts\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-06','2023-06-12'),('전시','A39','영상','영화의 기후: 섬, 행성',12000,'부산현대미술관','부산/경상','23.04.19 - 23.06.20','\n<h1></h1>\n부산현대미술관 최초의 정례전인 기획전《영화의 기후: 섬과 행성, 포스트콘택트존》은 \n세계적으로 이슈가 되고 있는 환경문제에 대한 담론을 제공하는 다양한 장르의 영화를 상영하는 전시이다. \n올해부터 격년제로 실시되는 본 기획은 영화감독이자 한국예술종합학교 교수로 재직 중인 김소영 교수와의 협력을 통해 세계적으로 주목 받고 있는 \n사오닷 이스마일로바, 차이밍량 등 국제적으로 주목받고 있는 영화 감독 78명의 100여 편 작품을 감상할 수 있는 기회를 제공한다.<br><br>\n이 전시는 생태학, 인류학 및 정치경제학, 그리고 영화의 역사에 주목한다. \n기후 위기와 역사의 기후, 영화의 기후가 서로 긴밀히 연결된 채 대체로 <느린 영화>와 <느린 과학>의 <행성적 사유>를 따라간다.',NULL,'https://linktr.ee/MoCABusan','A3939','\n\n\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681748055159\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681748055159\",\n		\"key\" : \"2egtt\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n\n',NULL,'2023-04-19','2023-06-20'),('전시','A40','사진','김중만 사진전',10000,'갤러리 래','부산/경상','23.04.02 - 23.06.17','\n\n<h1></h1>\n이번 전시 대표작품인 [I was waiting for you]는 작가가 \n10년간 중랑천 둑방길의 나무를 촬영한 것으로 각박한 세상을 꿋꿋이 견뎌나가는 나무를 포착한 것입니다. \n작가가 집에서 작업실로 가던 길인 둑방길에는 성한 나무가 없었고 주로 트럭이 다니던 비좁은 길가에 나뭇가지가 잘리고,\n비바람에 시달린 흔적이 가득한 나무들이 많았습니다. \n작가는 매일같이 지나는 길에서 본 상처난 나무들에게서 작가에게 내재된 상처를 보았을지도 모릅니다. <br><br>\n그리고 그때부터 오랫동안 이 나무들과 교감하며 작업을 시작하였고 지금의 작품들이 나오게 되었습니다.\n대형한지에 흑백으로 인화하여 수묵화처럼 느껴지기도 하는 이 작품 속 나무는 김중만작가의 느낌이 물씬 풍겨나오는 작품입니다. <br><br>\n갈라지고 부러져도 버티는 나무가 각박한 세상을 묵묵히 견디는 사람, 혹은 그 기나긴 세월을 잘 견뎌왔던 작가와 같이 느껴지기도 합니다. \n가만히 작품을 보고 있으면 은은하게 발산하는 작품의 이미지는 사진보다는 하나의 영상처럼 생동감을 느끼실 수 있을 것입니다.\n\n\n',NULL,'http://www.galleryrae.com/index.html','A4040','\n\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681748411154\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681748411154\",\n		\"key\" : \"2egtu\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n',NULL,'2023-04-02','2023-06-17'),('전시','A41','사진','풍경, 저 너머',12000,'닻미술관','광주/전라','23.04.08 - 23.06.18','\n\n<h1></h1>\n \n\n전시 《풍경, 저 너머》는, 2021년 닻미술관의 기획전 《집》과 이어지는 그의 두 번째 사진전이다. 기록 사진으로 시작해 예술로서 사진의 확장을 보여주는 작가의 후반기 작업 중 - ‘잃어버린 풍경’, ‘장미’, ‘사진 속의 추상’, 이 세 가지 시리즈를 함께 엮었다. 서서히 빛을 잃어가는 순백의 장미와 하나로 만나지는 검은 풍경, 선명하고도 모호한 질감의 추상 사진이 함께 전시장에 있다. <br><br>어쩌면 이것은 생기가 찾아온 봄과 그것들이 떠나버린 겨울 사이에 남겨진 허공을 향한 이야기다. 사라지는 것과 남겨진 것들 사이에 아름다운 그의 사진이 있다.\n\n\n',NULL,'https://www.datzmuseum.org/blogPost/2023_beyond-landscape','A4141','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682350318204\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1682350318204\",\n		\"key\" : \"2ejhz\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-08','2023-06-18'),('전시','A42','사진','아시아의 또 다른 바다',15000,'전남도립미술관','광주/전라','23.04.11 - 23.07.16','\n\n\n\n\n<h1></h1>\n \n\n<아시아의 또 다른 바다> 전은 한국에서 남해를 앞에 둔 전남도립미술관이라는 지리적 문화화적 특성에서 아시아의 예술을 생각하며 출발한다. 또 다른 바다란 탈이념과 탈경계로 바라보기 위한 것이다.  한 지역의 역사와 문화적 관습을 통해 동시대의 관점에서 다중적인 현상이 시공을 초월할 수 있는 바다로 강한 메시지를 전한다. 반도 남단에서 시작한 한국의 예술가들을 통해 남태평양으로 항해하며 대만의 예술가를 만나고, 또 동쪽으로 나아가 일본의 예술가들과도 대화하면서 심오한 바닷속의 다중적인 의미를 기록한다.\n\n \n\n\n\n\n\n\n\n\n',NULL,'https://artmuseum.jeonnam.go.kr/museumofart/index.do','A4242','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682351014264\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1682351014264\",\n		\"key\" : \"2ejh3\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-11','2023-07-16'),('전시','A43','회화','리처드 케네디',12000,'전남도립미술관','광주/전라','23.03.13 - 23.06.04','\n\n\n <h1></h1>\n \n이번 전시인 《에이시-듀시》에서 리처드 케네디는 사회의 고정관념을 드러내고, 또 이를 허물어 버리는 작업을 선보입니다. 흑/백, 남/여, 정신/육체, 승자/패자, 스승/제자, 고급 문화/대중 문화, 순간성/같은 이분법적 가치 체계는 그의 작품 속에서 헝클어지며, 양극 어느 쪽에도 속하지 않는 대안적 방식을 작가는 제시합니다. 커다란 몸짓으로 붓을 휘두르고, 그 흔적을 켄버스에 덧칠하여 구체적인 형상을 덮어버리는 것으로 이를 통하여 자신과 같은 퀴어 아프리카계 미국인에 대한 편견을 지워봅니다. <br><br>최근의 회화 작업에서는 캔버스 공간 안으로 빠져드는 또다른 자유로움을 찾기도 하는데, 망친 그림 작품을 잘라 엮으며 실패마저 성공으로 만드는 작업을 새로 시작하게 되었습니다. 이 전시는 이러한 그의 회화 20여 점과 더불어 라이브 퍼포먼스와 신작 비디오 〈기적을 만드는 중〉을 관객에게 선보입니다. \n \n\n\n\n\n\n\n\n\n',NULL,'https://artmuseum.jeonnam.go.kr/museumofart/index.do','A4343','\n\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1682351014264\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1682351014264\",\n 		\"key\" : \"2ejh3\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n \n\n\n\n\n\n\n\n',NULL,'2023-03-13','2023-06-04'),('전시','A44','회화','김혜숙 개인전',10000,'광주문화예술회관','광주/전라','23.04.07 - 23.07.07','\n\n\n<h1></h1>\n \n김혜숙 작가는 현대인의 무의식적 욕망과 기억, 꿈을 비춰내는 작업을 선보이며, 전시는 회화 28점이 구성된다. 작가는 다양한 이미지와 언어가 기록된 일간지를 한 겹 한 겹 접고 붙이는 작업을 통해 매일 같은 모습으로 반복되는 일상, 수많은 시간의 흔적을 기록한다. 작품 속 중첩된 기억의 조각들과 무수한 붓질의 터치들은 수행의 과정이자 작가 자신의 삶을 되돌아보는 자아 성찰의 시간이다. 그의 작품은 우리가 일상에서 겪는 고뇌와 갈등을 평온한 분위기로 위로하기도 하고, 빛을 향해 나아가는 따뜻한 희망으로 제시한다.<br><br>\n\n매일 바쁘게 스쳐 가는 하루 속에서 자신을 되돌아볼 시간은 그리 많지 않다. 이번 전시를 통해 진정한 자신의 모습을 마주하고 발견해보는 시간을 가져보길 바란다.  \n\n\n\n\n',NULL,'https://gjart.gwangju.go.kr/cmd','A4444','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682351790271\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1682351790271\",\n		\"key\" : \"2ejh4\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n\n',NULL,'2023-04-07','2023-07-07'),('전시','A45','회화','제14회 광주비엔날레',15000,'광주비엔날레전시관','광주/전라','23.04.07 - 23.07.09','\n<h1></h1>\n \n제 14회 광주비엔날레가 <물처럼 부드럽고 여리게> (soft and weak like water)를 주제로 2023년 4월 7일부터 7월 9일까지 94일 간 열립니다.\n이번 전시 주제인 <물처럼 부드럽고 여리게>는 세상에서 물이 가장 유약하지만, 공력이 아무리 굳세고 강한 것이라도 그것을 이겨내지 못한다라는 의미의 도덕경 유약어수에서 차용했습니다. 전환과 회복의 가능성을 가진 물의 속성을 원동력 삼아 우리가 사는 지구를 공존과 연대, 돌봄의 장소로 제안하고자 합니다. <br><br>\n서로 다른 문화적 배경을 지닌 다양한 세대의 작가들이 잊혀진 과거와 역사를 현재로 소환하며, 그동안 변방이었던 서사를 중심으로 전환시키는 작업들을 펼쳐냅니다.\n\n\n\n\n',NULL,'http://www.gwangjubiennale.org/gb/intro.do','A4545','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682351901063\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1682351901063\",\n		\"key\" : \"2ejh5\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n\n',NULL,'2023-04-07','2023-07-09'),('전시','A46','영상','어쩌면 우리가 보지 않았던 것들',10000,'대전시립미술관','대전/세종/충청','23.05.02 - 23.07.16','\n<h1></h1>\n \n한때 ‘너와 우리’라는 카테고리에 없던 것들이 있었다. 그러나 지금은 매체의 확산으로 다문화와 혼혈가정과 같은 낯선 공동체를 인지하고, 1인 가구 증가로 동식물처럼 비인간에 속하는 것을 인격화한다. 《어쩌면 우리가 보지 않았던 것들》에서는 자기 인식의 발현 계기를 ‘타자와 관계맺기’로 정의하면서, 우리가 보려고 하지 않았던 타자와의 연결고리를 다층적으로 포착하고자 한다. <br><br>우리는 전체에 존재하는 일부이다. 이번 전시로 자라나는 세대들의 자아가 이로운 공동체 감정으로 올곧아지며 기꺼이 타자에게 질문하려는 마음이 샘솟기를 기대해 본다.\n\n',NULL,'https://www.daejeon.go.kr/dma/DmaExhibView.do?exYear=&exType=02&menuSeq=6084&exSeq=105606&&pageIndex=1','A4646','\n\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682352578396\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1682352578396\",\n		\"key\" : \"2ejh6\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n\n\n\n\n\n\n\n\n\n',NULL,'2023-05-02','2023-07-16'),('전시','A47','영상','열린수장고 기획전',10000,'대전시립미술관','대전/세종/충청','23.05.02 - 23.10.10','\n<h1></h1>\n \n대전시립미술관의 미디어아트 컬렉션 가운데, 박현기(b.1942~2000), 육태진(b.1961~200), 김해민(b.1957)의 비디오 작업을 중심으로 한국 미디어아트의 세대별, 작가별 독자성과 실험성을 조망하고자 한다. 이들의 작품은 대전의 뉴미디어아트의 역사와 전개 등 새로운 기술매체가 야기한 미학적인 변화와 이를 수용해 나간 대전미술의 실험성을 살필 수 있다. <br><br>전시는 실험적이고 전위적 태도로 새로운 예술을 표명했던 이들 작가들의 작업을 통해 기술과 예술의 결합으로 변화한 미디어 아트와 그를 둘러싼 미학적 쟁점과 그 의미를 살필 것이며, 열린수장고 기획전으로서 작업의 설치 매뉴얼, 소장품 기록 등도 공개될 예정이다.\n\n\n\n\n\n\n\n\n\n',NULL,'https://www.daejeon.go.kr/dma/DmaExhibView.do?exYear=&exType=02&menuSeq=6084&exSeq=105613&&pageIndex=1','A4747','\n\n \n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1682352578396\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1682352578396\",\n 		\"key\" : \"2ejh6\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n \n \n \n \n \n \n \n \n \n \n \n\n\n',NULL,'2023-05-02','2023-10-10'),('전시','A48','영상','수요일은 인디고블루',13000,'대전시립미술관','대전/세종/충청','23.03.23 - 23.09.19','\n\n \n<h1></h1>\n \n‘공감각’이란, 소리를 들으면 색이 보인다거나, 특정단어에서 색을 보는 등, 서로 다른 감각간의 교차를 경험하는 현상이다. 공감각적 경험은 매우 개별적인 것으로, 과학과 비과학 사이, 현실과 상상 사이 어딘가에 위치한 영역으로 여겨져 왔다. 개인의 정체성에 있어서 몸의 경험, 감각적 기억은 중요한 축을 차지한다. <br><br>\n\n신체와 감각을 중심으로 인간본질에 대한 사유가 활발히 이루어지고 있는 오늘날, 이번 전시는 인간의 개별적 정체성에 있어서 보다 원천적이고 자유로운 감각의 힘과 예술적 확장 가능성을 다층적으로 실험한 작업들을 조명한다. 동시대 예술가들의 공감각적인 작업을 통해 이 시대 새로운 감각적 사유를 맛보는 기회가 되기를 \n  바랍니다.\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n\n\n',NULL,'https://www.daejeon.go.kr/dma/DmaExhibView.do?exYear=&exType=03&menuSeq=6083&exSeq=105431&&pageIndex=3','A4848','\n\n \n \n  \n  <!-- * 카카오맵 - 지도퍼가기 -->\n  <!-- 1. 지도 노드 -->\n  <div id=\"daumRoughmapContainer1682352578396\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n  \n  <!--\n  	2. 설치 스크립트\n  	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n  -->\n  <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n  \n  <!-- 3. 실행 스크립트 -->\n  <script charset=\"UTF-8\">\n  	new daum.roughmap.Lander({\n  		\"timestamp\" : \"1682352578396\",\n  		\"key\" : \"2ejh6\",\n  		\"mapWidth\" : \"700\",\n  		\"mapHeight\" : \"330\"\n  	}).render();\n  </script>\n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n\n\n',NULL,'2023-03-23','2023-09-19'),('전시','A49','사진','유연 : 하늘지붕',12000,'스타트플러스 부산','부산/경상','23.05.10 - 23.06.27','\n\n \n<h1></h1>\n \n<h1></h1>\n \n하나의 장르에 안주하지 않고 늘 새로운 도전을 하는 강승윤은 수준 높은 사진들을 꾸준히 선보여왔다.\n강승윤은 이번 전시를 시작으로 사진작가 ‘유연’으로서의 활동을 본격화한다. <br><br>\n‘유연(Yooyeon)’은 모든 상황을 유연하게 대처하는 사람이 되고 싶은 마음을 담아 지은 작가명이다.\n이번 <하늘지붕> 개인전에서는 유연 작가만의 아날로그 감성과 시점을 담아낸 작품과 함께 하늘 지붕으로 향하는 여정을 만나볼 수 있다.\n\n<h4>문의</h4>\n070-8820-7706\n \n \n \n \n \n \n \n \n \n \n \n \n \n\n\n',NULL,'http://www.yooyeon.art/','A4949','\n\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683367352207\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683367352207\",\n		\"key\" : \"2eoon\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n \n \n \n \n \n \n \n \n \n \n \n \n\n\n',NULL,'2023-05-10','2023-06-27'),('전시','A50','사진','구름의 노래',10000,'닻미술관','서울/경기/인천','23.04.08 - 23.06.18','\n<h1></h1>\n \n누구나 구름을 찍는다.<br>\n사라질 순간이기에,<br>\n유일한 그 빛을 기억하기 위해,<br>\n내 안의 어떤 감정과 닮았기에.<br>\n추상을 이해하기 위해,<br>\n세계를 보고 있음을 확인하기 위해,<br>\n무한을 숭배하는 마음으로,<br>\n아름다움에 반하여,<br>\n그냥 이유 없이.<br><br>\n\n이 전시장을 나가면 펼쳐진 하늘이 눈 앞에 다시 보일 것이다. 가끔은 구름 한 점 없이 맑은 날도 있다. 매일 보는 하늘인데 한순간도 같지 않다. 현실의 중력 아래서 잠시라도 비상하는 꿈을 불러보자. 어릴 적 하늘의 구름이 주던 상상의 놀이를 떠올릴 수 있어도 좋겠다.\n<br><br>\n<h4>문의</h4>\n070-4193-2581\n \n \n \n \n \n \n \n \n \n\n\n',NULL,'https://www.datzmuseum.org/','A5050','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683367842176\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683367842176\",\n		\"key\" : \"2eooq\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n \n \n \n \n \n \n \n \n \n \n\n\n',NULL,'2023-04-08','2023-06-18'),('전시','A51','회화','마주치거나 마주한',10000,'우민아트센터','대전/세종/충청','23.04.17 - 23.06.02','\n\n \n \n  \n  \n\n \n  \n  \n  \n  <h1></h1>\n \n 《마주치거나 마주한》은 산책자이자 수집가로서 일상 속에서 다양한 이미지를 발견하고 기억에 남는 것을 수집하고 재구성하여 시각언어로 풀어내는 이정은 작가의 개인전입니다. <br><br>\n 작가는 매우 사소하기 때문에 무심코 스쳐 지나가는 단편적 이미지와 사물, 순간을 재조명하여 작업에서 다룹니다. 길을 걷다 보이는 사물, 작업실로 걸어가는 길, 테이블 위의 물건 등은 작업의 주요 소재가 됩니다. \n 사물과 풍경, 이미지의 잔상 그리고 대상의 시각적 형태에서 비롯된 색과 선, 형태 등의 조형 요소들은 화면에 나열되거나 중첩되며 새로운 이미지로 재구성됩니다. <br><br>\n <h4>문의</h4>\n 043-222-0357\n \n \n\n \n \n \n',NULL,'http://wmnew.ngelnet.com/','A5151','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683368818837\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683368818837\",\n		\"key\" : \"2eoos\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n \n \n \n \n \n \n \n \n\n\n',NULL,'2023-04-17','2023-06-02'),('전시','A52','회화','히스테리아',13000,'일민미술관','서울/경기/인천','23.04.14 - 23.06.25','\n\n \n \n  \n  \n <h1></h1>\n \n <히스테리아: 동시대 리얼리즘 회화>는 동시대 작가 13인의 작업을 통해 회화의 리얼한 경향을 살피고 이를 독자적인 한국 미술의 계보에서 조망한다. \n 전시가 다루는 리얼리즘은 객관적이고 실증적인 태도로 작가에 의해 성립하는 세계 인식·표현의 방식이다. \n 리얼리즘 회화는 재현과 재현의 대상을 일치시키기 위해 노력하는 동시에 현실을 이루는 사건과 사물을 균질하게 인식하고자 한다. \n 또 이에 기반한 형상적(figural) 그리기를 통해 그리는 대상을 역동적인 힘 속에, 때로는 촘촘한 감각의 연결망 속에 놓인 객체로 대면한다.\n <br><br>\n \n <h4>문의</h4>\n 02-2020-2050\n  \n \n \n \n\n \n \n \n',NULL,'http://ilmin.org/kr/','A5252','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683374757743\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683374757743\",\n		\"key\" : \"2eop6\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-14','2023-06-25'),('전시','A53','회화','이제 어떻게 하시겠습니까?',10000,'서울시립 북서울미술관','서울/경기/인천','23.04.25 - 23.07.09','\n\n \n <h1></h1>\n \n  《이제 어떻게 하시겠습니까?》는 미술관, 작가, 그리고 관람객의 적극적인 개입이 모여 상호작용을 일으키는 전시로, 관람객과의 관계에 대한 고민의 연장선상에서 기획되었다. \n <br><br>\n \n <이제 어떻게 하시겠습니까?>\n 이제 관람객의 차례다. 관람객은 한 명의 플레이어가 되어 자신의 의지대로 자유롭게 동선을 정하고, 작품과 상호작용하며 작품의 규칙 혹은 언어를 경험적 차원에서 흡수할 수 있을 것이다. 본 전시에서 관람객이 비디오 아트를 감상하는 즐거움과 작가들이 이야기하는 본질에 깊이 다가가기를 기대한다.\n \n <br><br>\n \n <h4>문의</h4>\n02-2124-8800\n  \n \n \n \n',NULL,'https://sema.seoul.go.kr/kr/whatson/exhibition/detail?exNo=1162991','A5353','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683374731982\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683374731982\",\n		\"key\" : \"2eop5\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-25','2023-07-09'),('전시','A54','회화','앨리스 북아트전',12000,'소전서림 북아트갤러리','서울/경기/인천','23.04.21 - 23.07.30','\n\n \n \n <h1></h1>\n\n어린 소녀, 굴속에 떨어짐, 커지고 작아지는 몸, 말하는 토끼와 고양이…….<br><br>\n\n\n<앨리스>라는 이 환상적 이야기는 압도할 만한 이미지들과 함께 책으로뿐만 아니라 영화나 전시로도 독자에게 끊임없이 다가간다. 그러나 한편 이런 생각이 든다. 계속 재탄생하는 이 <소설>을 우리는 제대로 알고 있을까? 리바이벌되고 복제되면 원본의 선명도나 의도가 조금씩 흐려지게 마련이니까.\n\n<br><br>\n\n<h4>문의</h4>\n02-511-2016\n \n\n\n',NULL,'http://sojeonseolim.com/','A5454','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683374706055\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683374706055\",\n		\"key\" : \"2eop4\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-04-21','2023-07-30'),('전시','A55','회화','ROTATION 자전',10000,'섹터스퀘어','서울/경기/인천','23.03.29 - 23.06.03','\n<h1></h1>\n\nROTATION은 총 10명의 작가들과 함께 릴레이 개인전 형태로 진행되고 있습니다.\n\n10명의 작가들은 각자의 일주 운동을 하며 지구를 중심으로 한 자신들의 작은 행성을 구축하는데, 이러한 시도는 회전이라는 물리적이며 서사적인 의미를 통해 전달됩니다. 이는 미래의 모습을 드러내거나, 상상할 수 있게 하는 규칙성과 연관되어 하나의 세계를 이루어 나가기도 합니다. <br><br>\n\n컬렉스 갤러리는 그러한 우리의 이야기를 담고 있는 미래 세계와 예술에 대해 말하고자 하며 매 순간을 살아가는 우리들의 모습 또한 반영합니다.\n<br><br>\n\n\n \n\n\n',NULL,'https://www.instagram.com/collexxgallery/','A5555','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683374682323\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683374682323\",\n		\"key\" : \"2eop3\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-03-29','2023-06-03'),('전시','A56','회화','또 다른 얼굴들',15000,'아세안문화원','부산/경상','23.04.26 - 23.07.23','\n<h1></h1>\n\nKF 아세안문화원과 유네스코 아태무형유산센터가 공동주최하는 협력전시 <또 다른 얼굴들: 한국과 아세안의 가면>은 인류 문화유산인 가면을 주제로 한국과 아세안 사람들이 만들어 낸 또 다른 얼굴들을 소개합니다. 각 지역의 축적된 미의식과 수공예 기술이 결합해 완성해 낸 한국과 아세안의 가면들은 그 자체로 각국의 미적 전통과 시대상의 반영이라도 할 수 있습니다.\n<br><br>\n\n\n',NULL,'https://www.ach.or.kr/ach/ru/cnts.do?srchOrdtmOperAt=&srchTxt=&sysId=ach&resveMasterSn=11961&ongoingAt=&mi=1702','A5656','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1683374654617\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1683374654617\",\n		\"key\" : \"2eop2\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n\n',NULL,'2023-04-26','2023-07-23'),('축제','B01','대전/세종/충청','피나클랜드 튤립 수선화 축제',12000,'피나클랜드 수목원','대전/세종/충청','23.03.24 - 23.05.31','<h1></h1>피나클랜드는 서울에서 1시간 30분거리, 충남 아산에 위치한 관광농원(수목원)입니다. 피나클랜드 수목원은 아산만 방조제 매립을 위해 채석장으로 사용된 곳으로 이창호 선생이 자녀들과 함께 손수 가꿔 만든 곳으로 2006년 7월에 개관하였습니다. <br><br>\n현재 피나클랜드는 식물원의 재배적 기능과 공원적, 전시적 기능을 수행함으로 자연이 주는 쉼과 치유를 제공하고 있습니다. 약 3.2만평 대지에 13개의 테마공간과 함께 어우러진 특색 있는 산책길들에 계정마다 다른 옷들을 입혀줍니다. <br><br>\n<b>피나클랜드에 봄이 피었습니다.</b> 길었던 겨울잠에서 깨어나 봄이 활짝 핀 피나클랜드. 형형색색 멋진 옷을 입은 튤립과 우아한 자태를 뽐내는 수선화들의 향연. 피나클랜드에서 직접 마을주민들과 함께 손수 키운 50만구의 튤립/수선화와 산들 봄 하늘 아래에서 정취를 느낄 수 있습니다.\n',NULL,'https://www.pinnacleland.co.kr/','B0101','\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1679887134450\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1679887134450\",\n 		\"key\" : \"2e858\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n',NULL,'2023-03-24','2023-05-31'),('축제','B02','대전/세종/충청','대전사이언스페스티벌',15000,'대전컨벤션센터','대전/세종/충청','23.05.01 - 23.05.31','온 가족 모두가 함께 소통하고 즐기는 미래과학세상이 펼쳐집니다.',NULL,'https://www.djsf.kr/','B0202','\n\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1679887164086\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1679887164086\",\n 		\"key\" : \"2e859\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n',NULL,'2023-05-01','2023-05-31'),('축제','B03','대전/세종/충청','유성온천 문화대전',8000,'온천로 일원 외','대전/세종/충청','23.06.12 - 23.06.14',' 유성온천문화축제는 1989년 유성온천과 과학도시 유성의 소중함을 현대적 감각에 맞게 계승시킨 축제로<br>지난 1989년 처음 개최돼 올해(2023년) 28회째를 맞고 있습니다.<br><br>\n유성온천의 유래와 효능을 바탕으로 ‘온천’을 주제로 한 축제가 시작되었으며, <br>과학의 도시 유성을 알릴 수 있도록 과학과 온천을 접목시켜 축제 프로그램을 운영하고 있습니다.<br><br>\n유성문화축제는 순수 주민참여형·주도형 축제로 주민이 만들어가는 축제라는데 큰 의미가 있습니다.<br>대부분의 프로그램과 체험부스 역시 주민들로 구성된 자원봉사자들의 주도로 운영되어지고 있습니다.\n',NULL,'http://ysfesta.com/index.php','B0303','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682407371693\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682407371693\",\n      \"key\" : \"2ejtr\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>\n',NULL,'2023-06-12','2023-06-14'),('축제','B04','대전/세종/충청','피나클랜드 불꽃 축제',12000,'피나클랜드 수목원','대전/세종/충청','23.03.25 - 23.05.27','<h3>피나클랜드 밤하늘에 별이 쏟아지는 불꽃축제</h3><br>\n 봄 하늘에도 화려한 꽃을 그려본다.<br>\n낮에는 튤립, 수선화가 봄을 맞이하고, 밤에는 불꽃이 피나클랜드의 봄을 수놓습니다.<br><br>\n<h4 style=color:red>행사 참석 시 항상 안전 사고에 유의하여 주시기 바라며, 안전하게 행사에 참여해 주시기 바랍니다.<br>\n행사를 준비, 운영하는 기관도 안전사고 예방을 위한 조치 당부 드립니다.</h4>\n<br>\n<h4>문의</h4>\n041-541-2582<br>\n ※ 일부 행사는 현장상황에 따라 변경 및 취소될 수 있습니다.\n    \n\n',NULL,'https://www.pinnacleland.co.kr/','B0404','\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 --