능하다. <br><br>\n<b>[행사내용]</b><br>\n버스커즈 월드컵 in 광주 : 국내외 버스킹 뮤지션들이 펼치는 세계 최대의 버스커즈 오디션 프로그램이다. <br>\n충장 월드퍼레이드 : 추억을 소환하는 경연퍼포먼스로 영화테마 또는 추억의 레트로 감성 이미지 연출한다.<br>\n추억의 테마거리 : 문방구, 전파사 등 추억의 거리를 재현하여 여러 가지 테마를 즐길 수 있는 거리이다.<br>\n세계 음식문화 존 : 우리나라를 비롯한 세계 각국의 길거리 음식문화를 체험하는 프로그램이다.<br><br>\n<b>[참가안내]</b><br>\n청바지를 입고 친구의 손, 연인의 손, 가족의 손을 잡고 충장축제에서 모두의 추억을 만나길 바란다.\n',NULL,'https://www.donggu.kr/index.es?sid=c8','B1313','<div id=\"daumRoughmapContainer1681116406488\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1681116406488\",\n      \"key\" : \"2eezg\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>\n',NULL,'2023-05-02','2023-10-17'),('축제','B14','광주/전라','2023 목포해상쇼',3000,'목포평화광장 해상무대','광주/전라','23.04.29 - 23.11.25','목포해상W쇼가 여러분을 찾아갑니다.<br><br>\n매월 마지막 주 토요일 밤 8시,<br>\n목포를 상징하는 노래로 스토리텔링한 창작뮤지컬과 형형색색의 아름다운 분수들이 춤추는 바다분수쇼, 화려한 불꽃쇼를 함께 펼쳐냄으로써 짙은 감동을 선사하는 Wonderful한 목표해상W쇼를 기대하세요.<br><br>\n* 자세한 사항은 공연홈페이지에서 확인하세요.\n',NULL,'http://mokpowshow.co.kr/','B1414','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682322329521\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682322329521\",\n      \"key\" : \"2ejc7\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-04-29','2023-11-25'),('축제','B15','광주/전라','제2회 전주국제그림책도서전',1500,'팔복예술공장 외','광주/전라','23.05.12 - 23.06.04','그림책은 단순히 이야기를 전달하는 것을 넘어<br>\n글과 그림의 상호작용을 통해 새로운 예술이 됩니다.<br><br>\n우리는 그림책을 통해 처음 세상을 만나고 그림책으로 새로운 세상을 그리기도 합니다.<br><br>\n제2회 전주국제그림책도서전은 언어의 벽을 넘어 세상과 소통할 수 있는\n여행의 길잡이가 되고자 합니다.<br><br>\n그림책의 다양한 가치를 공유하고 그림책의 잠재력을 확인하는\n전주의 두 번째 발걸음을 함께 해주시기 바랍니다.<br><br>\n페이지를 넘기면 펼쳐지는 다채로운 세상으로 여러분을 초대합니다.\n',NULL,'http://jipf.jeonju.go.kr/','B1515','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682325112153\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682325112153\",\n      \"key\" : \"2ejdf\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>\n',NULL,'2023-05-12','2023-06-04'),('축제','B16','광주/전라','2023 동아시아문화도시전주',12000,'한국소리문화의전당','광주/전라','23.05.29 - 23.06.30','<h1></h1><b><2023 동아시아 문화도시 전주에 오신 것을 환영합니다.></b><br><br>\n후백제부터 이어온 천년고도의 찬란한 역사와 문화를 품은 세계문화 중심도시 전주<br>\n그 전주가 중국의 청두, 메이저우, 일본의 시즈오카현과 함께 <2023 동아시아문화도시>로 선정되어 2023년을 힘차게 출발합니다.<br><br>\n전주만의 다양하고 독창적인 문화자산을 바탕으로 중국, 일본의 선정도시들과 매월 다채로운\n문화교류를 추진하여 상호간 문화연대와 소통을 통해, 아시아를 넘어 세계적인 역사문화 관광도시로 거듭나고자 합니다.<br><br>\nK-컬쳐의 새로운 바람을 불어올 J-컬쳐의 활약과 같은 듯 다르고, 다른 듯 같은 3국의 문화가\n만드는 문화예술 화합의 장.<br>\n그 특별한 체험과 매력에 여러분들을 초대합니다.<br><br>\n전주 천년의 역사문화로, 새로운 천년미래를 여는 세계문화 중심 도시.<br>\n전주 방문을 진심으로 환영합니다.',NULL,'https://cceajj.jeonju.go.kr/','B1616','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682326430615\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682326430615\",\n      \"key\" : \"2ejdx\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>\n',NULL,'2023-05-29','2023-06-30'),('축제','B17','광주/전라','제15회 정남진장흥물축제',1500,'탐진강 외','광주/전라','23.07.30 - 23.08.07','정남진 장흥 물축제는 전국 어디서나 볼수있는 프로그램으로 구성된 공연, 전시 및 관람 위주의 전형적인 축제의 틀을 벗어나 뜨거운 여름 누구에게나 반갑고 친숙한 “물”을 주제로 하여 방문객들이 함께 어울릴 수 있는 다양한 프로그램을 운영하고 있습니다.<br><br>\n“물”이라는 하나의 테마로 모든 프로그램이 연결되어 있어 사람들은 깨끗한 자연과 건강한 삶, 그 속의 쉼이 있는 정남진 장흥을 흠뻑 느끼고 즐길 수 있으며, 주 야간 계속되는 다채로운 프로그램은 어른에게는 바쁜 일상속에서 잊고 있었던 순수함을 되살려 주고 아이에게는 최고의 놀이터가 되어 줄 것입니다.<br><br>\n짜릿한 즐거움과 낭만, 뜨거운 여름을 한방에 날려 버릴 최고의 휴식처!<br>뜨거운 열정과 웃음이 가득한 곳!<br>\n초록 자연의 상징 정남진 장흥으로 오십시오.\n',NULL,'https://festival.jangheung.go.kr/festival','B1717','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682348173448\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682348173448\",\n      \"key\" : \"2ejgn\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-07-30','2023-08-07'),('축제','B18','광주/전라','여수 야경불꽃크루즈',37000,'미남크루즈','광주/전라','23.05.04 - 23.06.20','<5월 출항시간 오후 8시><br>\n- 월~목 : 힐링야경투어<br>\n- 금~일 : 선상불꽃투어<br>\n(5월 4일, 5일, 30일, 31일은 힐링야경투어 대신 선상불꽃투어가 진행됩니다.)<br>※ 매주 토요일 매진되었습니다.<br><br>\n<6월 출항시간 오후 8시><br>\n- 월~목 : 힐링야경투어<br>\n- 금~일 : 선상불꽃투어<br>\n(6월 1일, 2일, 6일은 힐링야경투어 대신 선상불꽃투어가 진행됩니다.)<br>※ 매주 토요일 매진되었습니다.',NULL,'https://cruisestory.co.kr/','B1818','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682400789229\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682400789229\",\n      \"key\" : \"2ejq8\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-05-04','2023-06-20'),('축제','B19','광주/전라','2023 순천만국제정원박람회',15000,'순천만국가정원','광주/전라','23.04.01 - 23.10.31','<b>\"대한민국 미래 정원의 세계로 여러분을 초대합니다!\"</b><br><br>\n전라남도와 순천시는 ‘2013순천만국제정원박람회’ 개최 10주년을 맞아 대한민국의 아름다운 정원문화를 세계에 알리기 위해, 전라남도가 동북아 정원문화산업 중심지로 도약하는 계기가 될, ‘2023순천만국제정원박람회’를 엽니다.<br>박람회 유치에 애써 주신 모든 분께 깊이 감사드립니다.<br><br>\n‘2013순천만국제정원박람회’는 대한민국 정원의 위상을 높였으며, 정원문화가 생활 속에 뿌리내리는 계기가 되었습니다.<br>440만여 명이 박람회장을 방문했으며, 1조 6천억여 원의 경제 효과를 거뒀습니다.<br>박람회 후에는 순천만 정원이 ‘대한민국 제1호 국가정원’으로 거듭나, 해마다 500만여 명이 찾는 관광 명소가 되었습니다.',NULL,'https://scbay.suncheon.go.kr/expo/index.jsp','B1919','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682403092869\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682403092869\",\n      \"key\" : \"2ejrb\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-04-01','2023-10-31'),('축제','B20','광주/전라','담양 대나무축제',3500,'추성경기장 외','광주/전라','23.04.17 - 23.06.12','<b>“2023 New Bamboo Festival 에 여러분을 초대합니다.</b><br><br>\n담양대나무축제는 대나무와 관련된 다양한 콘텐츠를 지속적으로 생산하여 선보임은 물론, <br>지역의 관광자원과 연계한 융복합 프로그램 구현을 통해 자연치유와 힐링의 기회를 제공하고 있습니다.<br><br>\n죽녹원을 비롯한 관방제림, 메타세쿼이아길, 창평슬로시티, 소쇄원을 통해 <br>담양의 문화 브랜드가 높아지고 있으며 담양의 자랑입니다.<br><br>\n담양을 찾아오시는 모든 관광객들에게 대숲맑은 생태도시 담양의 청정한 기운을 받아서 항상 건강하고 운수대통하시라는 의미로 ‘운·수·대·통’이라는 테마로 다양한 프로그램을 준비했습니다.<br><br>\n“담양대나무축제”에 오시면 ‘행복’과 ‘행운’을 가져 가실 수 있습니다. <br>자신있게 여러분을 초대합니다. 담양으로 오세요!',NULL,' http://www.bamboofestival.co.kr/index.do','B2020','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682406121579\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682406121579\",\n      \"key\" : \"2ejt6\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-04-17','2023-06-12'),('축제','B25','부산/경상','광안리 어방축제',7000,'광안리해변','부산/경상','23.05.12 - 23.06.09','역사와 전통, 즐거움과 웃음이 가득한 축제!광안리어방축제는 한국에서 유일하게 전통어촌의 민속문화를 소재로 한 축제로, 조선시대 수군과 어민의 어업 공동작업체인 어방(漁坊)을 소재로 하고 있다.<br><br>\n축제 기간에는 옛 수군병영과 어촌마을을 재현한 민속마을에서 20여 가지의 전시 및 체험프로그램을 즐길 수 있고 수군, 주모, 어민, 기생 등 다양한 인물들이 마을을 돌아다니며 방문객들을 즐겁게 해준다.<br><br>\n조선시대 부산지역의 수군대장인 경상좌수사의 행렬을 재현하고, 어방을 소재로 한 창작뮤지컬을 선보이는 등 볼거리도 알차다.<br><br>\n이밖에도 맨손으로 활어잡기, 한복체험, 아이들을 위한 그물낚시 체험 등 다양한 체험프로그램이 준비되어 있으며 화려한 계-폐막식과 문화공연이 펼쳐진다.<br><br>\n<b>[행사내용]</b><br>\n1. 대표 프로그램 : 뮤지컬 어방, 경상좌수사행렬 퍼레이드<br>\n2. 주제프로그램 : 어방민속마을, 진두어화, 어방그물끌기, 수문장교대식, 망궐례, 무형문화재 공연<br>\n3. 체험프로그램 : 맨손으로활어잡기, 어방수라간, 생선회깜짝경매, 내왕소리체험, 수영성민속대결, 어방을그리다. 어린이그물낚시체험, 광안리 비치코밍<br>\n4. 부대행사 : 경상좌수사행렬전시, 드론라이트쇼, 소망등 및 어등 전시, 싱싱활어장터',NULL,'https://www.suyeong.go.kr/festival/index.suyeong','B2525','<div id=\"daumRoughmapContainer1681118044566\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1681118044566\",\n      \"key\" : \"2eezw\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-05-12','2023-06-09'),('축제','B26','부산/경상','2023 하동세계차엑스포',10000,'하동스포츠파크 외','부산/경상','23.05.04 - 23.06.03','하동세계차엑스포는 <b>“자연의 향기, 건강한 미래, 차(茶)!”</b> 를 주제로 하동스포츠파크와 화개면에 있는 하동야생차문화축제장을 중심으로 열립니다. <br>하동군 내에서 그치지 않고 경상남도 내의 차와 관련된 곳들을 연결한 ‘티로드’에서도 여러 프로그램이 함께 진행됩니다.<br><br>\n세계의 명품 차, 하동 야생차밭의 추억과 기쁨을 친구, 가족과 함께 나누세요.<br>하동세계차엑스포가 차의 기준을 새롭게 정의합니다.',NULL,'https://www.hadongt.co.kr','B2626','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682330604156\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682330604156\",\n      \"key\" : \"2ejer\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-05-04','2023-06-03'),('축제','B27','부산/경상','봉화 은어축제',25000,'봉화읍 내성천 일원','부산/경상','23.07.30 - 23.08.07','대한민국을 대표하는 여름축제는 단연 봉화은어축제라고 할 수 있습니다.<br>은어는 조선시대 임금님 수라상에 오를 만큼 귀하고 영양가가 풍부한 민물고기입니다.<br>특히 오염되지 않은 낙동강, 섬진강 등 하천 상류의 청정 1급수에서 서식하고 있습니다.<br>낙동강과 한강수계 최상류에 위치한 봉화군은 “은어의 청정 이미지를 테마로 한 국내 최고의 여름문화축제”를 매년 여름  내성천 일원에서 개최하고 있습니다.<br><br>\n은어와 사람, 자연이 함게 어우러지는 자연생태축제!<br>청정봉화의 맑고 깨끗한 내성천에서 벌어지는 은빛은어의 향연!<br>자연과 함께하는 다양한 공연!<br>재미와 건강, 휴식이 있는 오감만족 축제!',NULL,'http://bonghwafestival.or.kr/index.php','B2727','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682349092910\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682349092910\",\n      \"key\" : \"2ejgs\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-07-30','2023-08-07'),('축제','B28','부산/경상','K-핸드메이드&일러스트레이션페어 부산',30000,'부산 벡스코','부산/경상','23.07.21 - 23.07.23',' 우리의 일상은 빠르게 변화하고 있지만, 사람의 손에서 정성스럽게 탄생하는 핸드메이드는 느리지만 아름답게 작지만 행복한 새로운 가치를 추구하며 오랜 기간 사랑받고 있습니다.<br><br>\n언제나 즐길 수 있는 취미 생활부터 창업 아이템은 물론, 더 나아가 나만의 가치를 실현하는 세상 하나뿐인 예술 작품 등 핸드메이드&일러스트레이션 산업은 여러 분야에서 주목받고 있습니다.<br><br>\n이에 ‘K-핸드메이드페어&일러스트레이션페어’는 핸드메이드 산업의 트렌드를 조망할 수 있는 비즈니스 플랫폼을, 손과 손이 모여 만들어가는 즐거운 추억과 새로운 기회가 가득한 핸드메이드&일러스트레이션페어 축제의 장을 마련합니다.',NULL,'http://busanhandmadefair.com/new_t/html/','B2828','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682350281670\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682350281670\",\n      \"key\" : \"2ejgy\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-07-21','2023-07-23'),('축제','B29','부산/경상','2023 광안리M드론라이트쇼',1000,'광안리해변','부산/경상','23.03.01 - 24.02.29','<b>「광안리 M 드론라이트쇼」</b>는 <br>전국 최초로 개최되는 상설 드론라이트쇼로 매주 토요일 매회 10분내외로 진행되며 광안리해변 어디서나 관람이 가능합니다. <br><br>특히 이번 드론라이트쇼에서는 상설공연 500대에서 특별공연 최대 1500대의 드론이 매주 계절과 기념일에 어울리는 새롭고 다채로운 콘텐츠를 선보일 예정이며 <br>드론 프러포즈 이벤트 등 다양한 시민참여 프로젝트도 기획중입니다. <br><br>이제 부산을 넘어 대한민국의 야간관광 킬러콘텐츠로 자리매김하여 전세계의 관광객이 보고싶어하는 쇼로 성장하고 있습니다. <br>아름다운 광안대교 배경으로 수백대의 드론이 광안리 밤하늘에 날아올라 전세계에 희망과 행복의 메시지를 보내며 관광객에게는 잊지못할 추억을 선사할 것입니다.',NULL,'http://gwangallimdrone.co.kr/','B2929','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682397157528\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682397157528\",\n      \"key\" : \"2ejog\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-03-01','2024-02-29'),('축제','B30','부산/경상','네이처파크 플라워페스티벌',18000,'대구 네이처파크','부산/경상','23.04.01 - 23.06.11','<b>시즌별 다양한 색감의 꽃들이 만발하는 교감 동물원 \"네이처파크\"</b><br><br>\n4월 1일부터 6월 11일까지 진행되는 플라워 페스티벌은 매화, 튤립, 장미, 수국 등 매 시즌 다른 꽃으로 구성된다.<br>\n꽃향기가 가득한 플라워 가든, 곳곳에 놓인 인생샷을 위한 포토존은 플라워 페스티벌에서 빼놓을 수 없는 즐길거리 중 하나이다.<br><br>\n자연속의 행복한 동물들과 같이 교감하고 즐길 수 있는 생태 교감형 동물원으로 어른, 아이 구분 없이 즐길 수 있는 곳이다.<br>\n열대 우림 환경을 재현해낸 국내 최대 파충류관을 오픈하여 볼거리 즐길거리가 배가 되었다.<br>\n주말마다 동물들과 교감하며 먹이 체험도 할 수 있는 동물탐험대 이벤트도 진행중이다.',NULL,'http://www.spavalley.co.kr/naturepark/','B3030','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682402308858\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682402308858\",\n      \"key\" : \"2ejqy\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>\n',NULL,'2023-04-01','2024-06-11'),('축제','B31','부산/경상','2023 파워풀대구페스티벌',7000,'국채보상로 일대','부산/경상','23.05.13 - 23.06.10','<b>시민이 만들고, 시민이 즐기는 거리로! 2023파워풀대구페스티벌 신난DAY, 힘난DAY!</b><br><br>\n<b>[A존]</b><br>음악이 흐르는 도시 대구! 보컬과 악기연주, 밴드 음악이 흐르는 A존은 페스티벌을 알리는 첫 번째 거리로\n페스티벌을 즐기러 온 시민들을 페스티벌에 흠뻑 빠지게 만들 거리입니다.<br><br>\n<b>[B존]</b><br>B존은 K문화가 세계로 뻗어가는 와중에도 우리의 흥과 멋하면 빠질 수 없는 전통과 극, 다문화가 공존하는 거리입니다.<br><br>\n<b>[C존]</b><br>자유롭게 흐르는 음악을 목소리와 악기가 아닌 아름다운 몸의 선으로 때론 몸의 역동적인 움직임으로 표현하는 C존은 최근 댄스에 흠뻑 빠져있는 대한민국에 걸맞은 활기 넘치는 거리입니다.',NULL,' https://www.pwf.or.kr/','B3131','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682403889834\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682403889834\",\n      \"key\" : \"2ejrp\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-05-13','2023-06-10'),('축제','B32','부산/경상','2023 낙동강자전거현장',1500,'낙동강문화관 외','부산/경상','23.05.20 - 23.06.20','을숙도 내 위치하고 있는 낙동강문화관부터 을숙도 생태공원과 맥도 생태공원을 잇는 코스로 구성되어 있으며<br>\n약 20km 코스를 완주하며 미션지의 미션을 모두 수행하면 소정의 기념품을 제공하는 행사이다.<br><br>\n인도어 라이딩, 친환경 자전거 발전기, 환경교육키트 만들기, 자전거 무료 점검,<br>\n자전거 용품 홍보 및 판매 등 친환경과 자전거와 관련된 다양한 부대행사도 함께 즐길 수 있다.<br><br>\n*운영시간: 10:00~17:00 (12:00~13:00 제외)',NULL,'https://cafe.naver.com/nakdongculture','B3232','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1682404402152\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!—\n   2. 설치 스크립트\n   * 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n—>\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!— 3. 실행 스크립트 —>\n<script charset=\"UTF-8\">\n   new daum.roughmap.Lander({\n      \"timestamp\" : \"1682404402152\",\n      \"key\" : \"2ejry\",\n      \"mapWidth\" : \"640\",\n      \"mapHeight\" : \"360\"\n   }).render();\n</script>',NULL,'2023-05-20','2023-06-20'),('축제','B41','서울/경기/인천','생생문화재 중랑구 체험학습',1000,'망우역사문화공원','서울/경기/인천','23.01.28 - 23.12.02','\n<h1></h1>\n「독립군이 보낸 한 장의 암호레터」<br><br>\n\n① 특명! 비밀결사의 단원이 되어라!(1~12월, 망우역사문화공원)<br>\n※ 독립운동가 서동일, 오재영이 직접 실행했던 활동의 재현 체험<br><br>\n\n② 특명! 독립군 밀서를 안전하게 전달하라!(4~5월, 봉수대공원)<br>\n※ 1부 : 조선시대 봉수군 되어보기<br>\n※ 2부 : 일제강점기 독립운동가 되어보기<br><br>\n\n③ 특명! 독립군과 연락하라(8~9월, 봉수대공원)<br>\n※ 통신의 발달과정 따라 독립운동 알아보기<br>\n※ 직접전달과 기억전달→봉수대→기류신호→편지와 밀서→모스부호→전화<br><br>\n\n④ 특명! 동지를 찾아나서라(6월, 망우역사문화공원)<br>\n※ 필름카메라(Analog)와 스마트폰(Digital)을 활용한 비밀결사 미션 수행 체험',NULL,'https://cafe.naver.com/jnsangsang','B4141','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680376218363\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680376218363\",\n		\"key\" : \"2eaqw\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-01-28','2023-12-02'),('축제','B42','서울/경기/인천','오산위클리클래식',25000,'MEG아트홀','서울/경기/인천','23.02.18 - 23.06.24','\n<h1></h1>\n2023년 2월 <제2회 오산 위클리 클래식 페스티벌> 대장정의 막이 오른다.\n경기도 오산시 최초의 민간 공연장으로 등록된 MEG아트홀에서 열리는 소극장 실내악 페스티벌로 2022년 첫해부터\n오산시민 뿐만 아니라 전국의 클래식 팬들을 오산으로 모이게끔 하는 경기 남부지역 예술의 중추적 역할을 하기 위한 디딤돌이 되고 있다.<br><br>\n<제1회 오산 위클리 클래식 페스티벌>에서는 약 50명의 연주자와 1,200명의 관객과 함께 하였는데 연령 제한이 없는 만큼,\n음악회가 처음인 미취학 아동 관객의 천진난만한 질문은 연주자 뿐만 아닌 함께 한 청중들에게도 신선한 감동과 큰 웃음을 선사하기도 하였다.\n',NULL,'https://korean.visitkorea.or.kr/','B4242','\n<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680458297356\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680458297356\",\n		\"key\" : \"2eauh\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>\n',NULL,'2023-02-18','2023-06-24'),('축제','B43','서울/경기/인천','불빛 동화 축제',9000,'허브아일랜드','서울/경기/인천','23.02.01 - 23.12.31','<h1></h1>\n잃어버린 동심을 만날 수 있는 시간! 매일 밤, 작은 불빛들이 만들어내는 동화 같은 세상은 누구에게나 잊지 못할 추억을 선사하며,\n누구나 불빛세상의 주인공으로 만들어줄 아름다운 불빛야경이 준비되어 있다. 허브아일랜드 불빛동화축제는 우리를 동화 속 세상으로 초대한다.\n결코 꺼지지 않는 불빛들의 네버엔딩스토리를 만나보자! <br><br>\n[안내사항]\n행사 참석 시 항상 안전 사고에 유의하여 주시기 바라며, 안전하게 행사에 참여해 주시기 바랍니다\n행사를 준비, 운영하는 기관도 안전사고 예방을 위한 조치 당부 드립니다.<br><br>\n[행사내용]\n산타마을: 라이팅쇼, 포토존\n만들기체험장: 젤캔들 만들기, 로즈마리 와인만들기, 라벤더 배게 만들기\n공룡마을: 미니기차, 공룡라이더',NULL,'http://www.herbisland.co.kr/','B4343','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680459024467\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680459024467\",\n		\"key\" : \"2eaui\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-02-01','2023-12-31'),('축제','B44','서울/경기/인천','대한민국 독서대전',1000,'일산호수공원','서울/경기/인천','23.03.01 - 23.09.03','<h1></h1>\n국내 최대 독서문화축제인 대한민국 독서대전이 2023년 고양시에서 개최된다. 연중 강연, 체험, 전시, 공연 등 6개 분야 약 100개의\n독서·출판·문화 분야의 다양한 프로그램이 운영될 예정이다. 3월 22일 ‘책의 도시’ 선포식을 시작으로 독서·출판·도서관·서점 관련 단체들과 협력해\n지역 독서문화를 활성화하는 참여 독서 프로그램을 연중 실시하고, 9월 1일 ~ 3일, 3일간 고양시 일산호수공원 일원에서 책과 연관된 공연·전시·체험·학술포럼 등\n다채롭고 차별화된 독서문화 행사를 선보일 예정이다. <br><br>풍부한 독서 인프라를 갖춘 고양시에서 책을 사랑하는 국민들의 적극적인 참여를 유도하여\n지역 유관기관과 다양한 계층이 책을 매개로 소통하고 함께 즐길 수 있는 축제의 장을 만들고자 한다.\n\n',NULL,'https://korearf.kpipa.or.kr/','B4444','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680891669498\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680891669498\",\n		\"key\" : \"2ede4\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-03-01','2023-09-03'),('축제','B45','서울/경기/인천','눈내림 별내림 불빛축제',6000,'산들소리','서울/경기/인천','22.12.17 - 23.12.31','<h1></h1>산들소리는 남양주시 별내동 불암산 자락에 위치해 있으며 4만2천평의 부지를 23년 동안 무농약으로 조성한 청정하고 깨끗한 힐링 공간이자 베이커리, 디저트와 음료를 판매하는 제빵소·카페입니다.\n1,200여종의 다양한 식물을 보유하고 있으며, 자연 속에서 즐길 수 있는 맛있는 음료와 베이커리로 일상에 지친 현대인들에게 자연의 쉼터가 되고 있습니다.\n서울 근교 가족들의 주말 나들이 장소로 각광 받고 있으며, 겨울에는 \"눈 오는밤 LOVE STORY\"를주제로한 별내림 눈내림 불빛축제를 관람 하실 수 있습니다!<br><br>\n[주의사항]\n산들소리 내 동물농장에 아기 염소들은 아직 어려서 당근을 먹지 못 합니다.<br>\n당근은 큰 염소와 토끼들에게만 주세요!<br>\n외부음식 또한 절대 반입 금지입니다.',NULL,'http://www.sandulsori.co.kr/default/main/main.php','B4545','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680891902313\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680891902313\",\n		\"key\" : \"2ede5\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2022-12-17','2023-12-31'),('축제','B46','서울/경기/인천','봄꽃축제',11000,'아침고요수목원','서울/경기/인천','23.04.21 - 23.05.28','<h1></h1>\n[행사 안내사항]\n행사 참석 시 항상 안전 사고에 유의하여 주시기 바라며, 안전하게 행사에 참여해 주시기 바랍니다.\n행사를 준비, 운영하는 기관도 안전사고 예방을 위한 조치 당부 드립니다.<br><br>\n[허브용품판매]\n허브용품판매장 정원가게 Gardenshop\n피로에 지친 현대인들을 위한 아로마 민트 스프레이, 환절기 답답한 콧속을 시원하게 해주는 굿브레쓰, 온 가족이 안심하고 사용할 수 있는 천연샴푸, 6가지 한약 재료로 만든 한방 수제비누 등\n천연 자연 유래 성분으로 만들어진 건강에 좋은 다양한 허브용품과 오가닉 제품들이 전시되어 있습니다. 자연이 주는 선물을 직접 경험해보세요!<br><br>\n[행사 내용]\n봄볕에 반짝이는 땅과 신록으로 물든 아침고요수목원은 축령산의 빼어난 산세와 어우러져 그림 같은 풍경을 자아낸다.\n튤립, 철쭉, 수선화 등 봄꽃 군락을 중심으로 목련, 진달래, 매화, 개나리, 벚꽃 등 다양한 봄꽃들이 가득 피어난 황홀한 모습을 감상할 수 있다.',NULL,'https://www.morningcalm.co.kr/html/main.php','B4646','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680892182306\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680892182306\",\n		\"key\" : \"2ede6\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-04-21','2023-05-28'),('축제','B47','서울/경기/인천','퍼스트가든 빛축제',12000,'퍼스트가든','서울/경기/인천','23.01.01 - 24.12.31','<h1></h1>\n퍼스트가든은 아름다운 조명으로 정원을 장식한 별빛축제를 365일 연중무휴 운영한다. 자수화단의 환상적인 별빛, 토스카나 광장의 이국적인 별빛,\n로즈가든의 정열적인 별빛은 추위로 얼어붙은 겨울밤을 녹이고 로맨틱한 겨울밤 분위기를 자아낸다. <br><br>\n[별빛이 흐르는 정원]을 슬로건으로 은하수를 담은 별자리 여행처럼 더 화려하고 볼거리가 많은 별빛축제로 새롭게 모습을 선보이며, 약 2만평 규모의 테마정원마다 다른 주제로 사계절의 대표 별자리를 비롯한 다양한 별자리가 지상에 내려앉은 모습을 볼 수 있다. 퍼스트가든 별빛축제는 4계절을 담아낸 다양한 별자리정원 뿐만 아니라 생명과 희망을 담은 ‘바오밥’나무 별빛, 나비정원 별빛 등 각 테마정원마다 스토리를 담아낸\n별빛테마정원과 곳곳마다 별빛황금마차, 별빛아이캐릭터 등 볼거리와 포토존으로 구성하여 연인과 가족들의 눈을 즐겁게 해줄 예정이다. 2020년 퍼스트가든 빛축제에는 작년에 비해 조명이 더 추가되어\n더욱 화려한 정원을 뽐내고 있다. <br><br>그 외에 퍼스트가든은 자동차극장, 레스토랑, 웨딩홀, 놀이시설, 체험학습, 기프트샵, 사계절 썰매장, 챌린지 코스 등 다양한 편의 시설을 갖추고 있어\n이번 겨울, 소중한 이들과 함께 즐거운 추억을 만끽할 수 있습니다. 큰 감동을 주는 아름다운 퍼스트가든 별빛축제로 지금 초대한다.',NULL,'https://www.firstgarden.co.kr/','B4747','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680892578506\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680892578506\",\n		\"key\" : \"2ede7\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-01-01','2024-12-31'),('축제','B48','서울/경기/인천','여주금사참외축제',1000,'근린공원','서울/경기/인천','23.05.26 - 23.05.28','<h1></h1>\n금사면 특산물인 금사참외를 주제로 현제 17회 개최로 이루어지는 여주의 대표적인 축제이다. 여주명품 금사참외의 홍보와 브랜드 가치를 제고하고\n관광객 유치 및 지역 농산물의 판매 증대로 지역경제 활성화 도모, 주민이 주도하는 체험 위주의 축제로 특색 있는 먹을거리·볼거리를 제공하여 전국적인 축제로 도약하고 있다.\n여주에서 생산된 명품 참외를 실컷 즐길 수 있는 명품금사참외축제는 산지 농가가 직접 판매하는 싱싱한 농산물을 저렴하게 만날 수 있는 기회를 제공한다.\n\n©2022 by 금사참외축제추진위원회\n경기도 여주시 금사면 이여로 1278\n대표전화 : 031-887-3902 팩스 : 031-887-3897',NULL,'https://www.xn--jj0bn76ahhehyg.com/','B4848','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1680892814354\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1680892814354\",\n		\"key\" : \"2ede8\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-05-26','2023-05-28'),('축제','B49','서울/경기/인천','창덕궁 달빛기행',30000,'창덕궁','서울/경기/인천','23.04.13 - 23.10.28','<h1></h1>\n조선시대 왕들의 사랑을 가장 많이 받았던 궁, 창덕궁에 여러분을 초대합니다. <br><br>\n은은한 달빛 아래 녹음이 어우러진 창덕궁에서 청사초롱으로 불을 밝히며\n궁궐 곳곳 숨은 옛이야기를 찾아보세요. <창덕궁 달빛기행>이 여러분을 기다립니다.<br><br>\n\n[유의사항]<br>\n- <창덕궁 달빛기행>은 지인 간의 양도가 불가능합니다.<br>\n- 단, 직계가족 및 형제/자매에 한해 참가자 신분증 및 증빙자료(등본, 가족관계증명서 등) 지참시에만 예외적으로 양도가 가능합니다.<br>\n- <창덕궁 달빛기행>은 1부 19:20 2부 20:00 로 나누어 예매가 진행되며, 현장 접수 <br>\n- 순서에 따라 입장 시간이 지정되어 운영되어니 예매 시 참고하여 주세요. (조별 5분 간격으로 입장)<br>\n- 1부제, 2부제 입장 시간 변경은 불가하오니 양해 부탁드립니다.\n',NULL,'https://www.chf.or.kr/chf','B4949','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681032878617\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681032878617\",\n		\"key\" : \"2edjx\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-04-13','2023-10-28'),('축제','B50','서울/경기/인천','웰컴투 조선',19000,'한국민속촌','서울/경기/인천','23.04.01 - 23.06.18','<h1></h1>\n행사 기간 주말과 공휴일에는 무고한 백성을 괴롭힌 사또를 벌하는 내용의 마당극 <사또의 생일잔치>가,\n평일에는 민속 마을 사람들이 잔치를 준비하며 일어나는 이야기를 다룬 마당극\n<지금 우리 고을은>이 펼쳐져 관람객들에게 볼거리를 제공할 예정이다. <br><br>또 입고 온 옷에 따라 신분이 정해지는\n<노비 7부제>가 시행돼 노비가 된 관람객과 추노꾼 캐릭터의 추격전이 펼쳐진다.\n추노꾼에게 잡힌 노비는 감옥에 갇히는 상황극을 함께 하게 된다. 이 밖에 재미난 MBTI 검사를 할 수 있는 3초 한약방을 비롯한\n각종 체험 행사가 열려 관람객의 눈길을 사로잡을 것으로 보인다.',NULL,'https://www.koreanfolk.co.kr/event/event_now.asp?seq=154','B5050','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681290743727\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681290743727\",\n		\"key\" : \"2ef22\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-04-01','2023-06-18'),('축제','B51','서울/경기/인천','달빛을 더하다',17000,'한국민속촌','서울/경기/인천','23.04.07 - 23.11.12','<h1></h1>\n전통문화 테마파크 한국민속촌이 고즈넉한 조선시대의 야경을 즐길 수 있는 <달빛을 더하다> 야간개장을 11월 12일까지 진행합니다.\n이번 야간개장은 초대형 멀티미디어 융합 공연인 <연분>을 리뉴얼하여 선보입니다. 궁중 무용인 <가화무>에 LED 퍼포먼스와 쉐도우 아트를 더한 연분은\n오픈과 동시에 큰 인기를 끌었습니다. 큰 인기에 힘입어 방문하는 많은 관람객들에게, 더 많은 볼거리를 제공하기 위해 연분 시작 전 오프닝 공연을 시작하며\n레이저를 활용해 한층 더 화려한 볼거리를 제공합니다.또한 한국민속촌 깊은 곳에는 워크스루형 공포체험 <귀굴:혈안식귀>는 작년 한 해 SNS에서도 반응이 뜨거웠던만큼\n올해는 더 무섭게 돌아와 관람객들에게 오싹한 추억을 선사합니다. <br><br>이외에도 올 여름을 더 시원하게 보낼 수 있도록 국내 최장 야외 공포체험 <살귀옥>을 준비 중에 있습니다.\n이외에도 민속마을 곳곳에서 다채로운 체험 콘텐츠와 포토존을 만나볼 수 있습니다. 달빛이 그린 그림자로 인생샷을 남길 수 있는 달빛, 단청, 연분, 가마 포토존은 특별한 그림자 사진 연출이 가능합니다.\n사극드라마 단골 촬영지인 목교 포토존과 지곡천 달 포토존도 놓칠 수 없는 야간개장 스테디셀러입니다.',NULL,'https://www.koreanfolk.co.kr/','B5151','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681623897942\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681623897942\",\n		\"key\" : \"2eg8v\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-04-07','2023-11-12'),('축제','B52','서울/경기/인천','화성 뱃놀이 축제',6000,'서신 전곡항','서울/경기/인천','23.06.09 - 23.06.11','<h1></h1>\n화성시 대표축제 화성 뱃놀이 축제는 이색적인 요트 승선체험을 즐길 수 있는 해양 문화 축제이다. \n올해 축제 최초로 밤바다 승선체험을 진행하며, 낮부터 밤까지 배로 즐길 수 있도록 프로그램을 확대할 예정이다. 해상 케이블카와 제부 마리나를 연계하여 다채로운 요트 승선 체험을 선보이고,\n수상 스테이지 공연을 즐길 수 있는 전국 최초의 해상 파티 프로그램이 진행된다. <br><br>또한, 시민의 열정으로 거리를 채우는 ‘바람의 사신단 시민 댄스 퍼레이드’도 한층 확대되어 펼쳐질 예정이다.\n이외에도 대중가수 공연, 야간 프로그램, 플로깅, 독살체험, 어촌마을체험, 수상 무동력기구 체험 등 다채로운 볼거리와 연계·부대행사가 준비되어 있다.<Br><br>\n[진행 프로그램]<br>\n바람의 사신단 (댄스 퍼레이드), 전곡행요트(승선), 풍류단의 항해(해상공연), 천해(天海) 유람단 (승선 및 케이블카), 뱃놀이 라이브 스튜디오, Zoom in 버스킹, 공중공연, 드론 라이트 쇼,\n어촌마을체험, 마린 플로깅, 미디어실감전시관, 낭만피크닉, 마린공공예술 등\n\n',NULL,'https://www.xn--w80b27rf1djwh9xaf4vx1p.com/','B5252','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681624462686\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681624462686\",\n		\"key\" : \"2eg8w\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-06-09','2023-06-11'),('축제','B53','대전/세종/충청','영동포도축제',1000,'영동레인보우힐링관광지','대전/세종/충청','23.08.24 - 23.08.27','\n<h1></h1>매년 8월 말이 되면 포도의 고장인 영동에서 열리는 대표적인 축제이다.<br><br> 전국 최대의 재배면적(2,209ha)과 품질 좋은 포도를 전국에 알리기 위해 축제이며,\n단순히 포도를 먹기만 하는 축제 아니라 포도를 직접 따는 체험부터 포도를 이용해서 와인, 포도즙 등 여러 가지 제품을 만들고, 포도밟기 등 수십 가지의\n다양한 체험들이 함께하는 오감만을 만족할 수 있는 즐거운 축제의 장이다. <br><br>수도권에서 멀지 않아 당일치기로도 즐길 수 있으며,\n어린아이에게 눈높이를 맞춘 다양한 행사까지 준비되어 있다.\n',NULL,'https://www.koreanfolk.co.kr/event/event_now.asp?seq=154','B5353','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681291406816\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681291406816\",\n		\"key\" : \"2ef24\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-08-24','2023-08-27'),('축제','B54','대전/세종/충청','청주공예비엔날레',12000,'문화제조창','대전/세종/충청','23.09.01 - 23.10.15','\n<h1></h1>\n공예가들은 인간의 몸과 자연이 맺고 있는 직접적인 관계를 매 순간 확인하며 작업합니다. 공예는 인간과 자연 사이에 수천 년간 이어진\n직접적이고 육체적인 교감과 공진화의 역사이자 결과물입니다. 2023년도 청주공예비엔날레는 공예가 가진 이런 특별한 능력과 힘,\n그리고 인간과 자연의 공진화로 만들어진 다양한 사물들과 그들 사이의 관계에 주목합니다. \n<br><br>열세 번째 청주공예비엔날레를 준비하면서 우리는 행복한 세상을 꿈꾸고 있습니다.\n지난 청주공예비엔날레를 통해 우리는 새로운 세상의 문을 열었습니다.\n낡았으되 결코 초라하지 않은 옛 연초제조창의 익숙함을\n우리는 세상과 사람들을 더욱 빛나게 하는 공예로 물들이고, 곱게 수를 놓는 새로움으로 승화시켰습니다.\n',NULL,'https://www.okcj.org/ccb2023/','B5454','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681291679647\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681291679647\",\n		\"key\" : \"2ef26\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-09-01','2023-10-15'),('축제','B55','대전/세종/충청','영동난계국악축제',1000,'영동레인보우힐링관광지','대전/세종/충청','23.10.06 - 23.10.09','\n<h1></h1>\n영동난계국악축제는 한국에서 3대 악성 중 하나로 꼽히는 난계, 박연 선생이 태어나고 자란 영동에서\n열리는 국악축제이다. 한국 유일의 국악축제로! 정통 국악공연부터 퓨전국악까지 다양한 국악공연이 펼쳐진다.\n국악기를 직접 연주해보고 만드는 과정을 체험해볼 수 있으며, 어가행렬 및 종묘제례 시연 등의 볼거리 또한\n풍부하다. 영동난계국악축제는 한국 최고의 와인을 소개하는 축제인 대한민국 와인축제와 함께 열린다.\n국악의 선율이 가을바람을 타고 흐르는 영동난계국악축제. 우리나라 3대 악성으로 추앙받는 천재적인 음악가이자 음악이론가,\n난계박연선생이 태어나고 자란 영동에서 한국 전통의 다양한 음악들을 선보이는 축제이다. <br><br>우리의 멋, 국악과 함께 어울려지는\n다양한 퍼포먼스들의 향연을 놓치지 말고 즐겨보길 바란다.\n',NULL,'http://www.ydnan-gye.co.kr/','B5555','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681292034984\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681292034984\",\n		\"key\" : \"2ef28\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-10-06','2023-10-09'),('축제','B56','대전/세종/충청','대한민국와인축제',1000,'영동레인보우힐링관광지','대전/세종/충청','23.10.06 - 23.10.09','\n<h1></h1>\n대한민국 최고의 와인을 소개하는 대한민국와인축제는 영동에서 재배되는 포도로 빚어진\n32개의 와이너리 농가에서 만든 와인뿐만 아니라, 관외지역의 와인까지 소개하고 함께 즐기는 축제입니다.\n한국 유일의 국악축제인 영동난계국악축제와 함께 열리며 뜨거운 반응이 보여지고 있습니다.<br><br>\n\n영동 와인은 품질 좋은 영동포도 중 고당도의 최고급 포도만을 엄선하여 와인을 만들어 품질이 당연 우수합니다.\n포도의 자생효모를 이용하여 첨가물 없이 숙성하여 만드는 영동와인은 건강에 또한 좋습니다.\n',NULL,'http://www.ydnan-gye.co.kr/','B5656','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681292034984\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681292034984\",\n		\"key\" : \"2ef28\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-10-06','2023-10-09'),('축제','B57','대전/세종/충청','태안빛축제',10000,'네이처월드','대전/세종/충청','23.01.01 - 23.12.31','<h1></h1>\n일년 365일 연중무휴로 진행되는 태안빛축제가 대한민국의 밤하늘을 책임집니다.<br><br>\n\n네이처월드가 준비한 빛축제 Q&A!!\nQ : 매표는 아무때나 가능한가요?\nA : 매표소는 축제 운영시간에 맞춰 오픈합니다ㅠㅠ<br><br>\n\n​Q : 인터넷예매는 당일 사용 가능한가요?\nA : 인터넷예매의 경우 구매한 다음날부터 사용 가능하기때문에\n방문 1일전에 구입하시면 됩니다!<br><br>\n\n​Q : 빛축제 구경하는데 얼마나 걸리나요?\nA : 보통 1시간~1시간 30분정도 생각하시면 됩니다!\n사진을 많이 찍으실 경우 최대 2시간정도 소요됩니다.<br><br>\n\n​Q : 휠체어,유모차 대여 되나요?\nA : 네! 무료로 대여해드리고 있으며, 입장하시자마자 오른쪽 종합안내소에 구비되어 있습니다.',NULL,'http://www.ydnan-gye.co.kr/','B5757','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681292656255\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681292656255\",\n		\"key\" : \"2ef2c\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-01-01','2023-12-31'),('축제','B58','대전/세종/충청','한산모시문화제',1000,'한산모시관','대전/세종/충청','23.06.09 - 23.06.11','<h1></h1>한산모시문화제를 소개합니다!<br><br>\n한산모시문화제는 대한민국을 대표하는 친환경 전통섬유 축제로,  유네스코 인류무형문화유산에 등재된\n\"한산모시짜기\"의 역사성과 우수성을 널리 알리기 위해 개최되는 전통문화축제입니다.\n한산모시문화제는 매년 6월에 서천군 한산면 한산모시관 일원에서 개최되며,\n모시학교, 미니베틀짜기, 저산팔읍길쌈놀이 등 다채로운 모시 문화 프로그램이 여러분을 기다리고 있습니다.<br><br>\n또한, 한산모시문화제는 과거부터 우수한 품질로 인정받았던 서천군 한산면에서 생산된 한산모시의 우수성과모시문화를 널리 알리기 위해 열리는 문화제입니다.\n2011년 [한산모시짜기]가 유네스코 인류무형문화유산으로 등재되어 그 가치를 세계적으로 인정받았으며,\n중요무형문화재 제14호 방연옥 선생님과 한산면 어머니들이 함께 그 명맥을 이어나가고 있습니다.\n즐거운 축제 한바탕 즐기고 가세요~!',NULL,'https://hansanmosi.kr/','B5858','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681293246312\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681293246312\",\n		\"key\" : \"2ef2e\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-06-07','2023-06-11'),('축제','B59','대전/세종/충청','금산 삼계탕 축제',1000,'금산인삼관 광장','대전/세종/충청','23.07.07 - 23.07.09','<h1></h1>\n<대한민국 대표 보양식 삼계탕, 금산 인삼·약초를 만나다>\n여름철 보양대표음식으로 손꼽히는 삼계탕에 여름 ‘물’체험과 건강 ‘약초’체험이 어우러진 전국 최초의 삼계탕 축제로서\n금산에서만 맛볼 수 있는 인삼·약초 삼계탕 한 그릇과 다채로운 여름 건강문화체험으로 가족의 건강도 챙기면서\n색다른 즐거움을 만끽할 수 있는 금산 여름 대표 축제입니다.\n<h4>문의</h4>\n041-750-2306\n\n',NULL,'http://www.insamfestival.co.kr/html/kr/sub4/sub4_0401.html','B5959','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681293481015\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681293481015\",\n		\"key\" : \"2ef2f\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-07-07','2023-07-09'),('축제','B60','대전/세종/충청','보령머드축제',12000,'보령해양머드박람회장','대전/세종/충청','23.07.21 - 23.08.06','<h1></h1>머드란? 머드는 ‘물기가 있어 질척한 흙’ 이란 뜻으로\n보통 진흙을 함유한 점토성 물질과 동식물들의 분해산물과 토양, 염류 등이 퇴적되어\n오랜 세월 지질학적, 화학적 및 미생물의 분해작용을 받아 형성된 것이다.<br><br>\n머드의 특성과 효능으로는 보령 대천해수욕장 주변 해안에서 채취한 양질의 바다진흙을 가공한 머드파우더와 머드 파우더에서 추출한 머드 워터가 함유되어 있으며 덕분에 \n피부 노화방지, 피부노폐물 제거 등 피부 미용에 뛰어난 효능을 가지고 있다.<br><br>\n\n세계인과 함께하는 신나는 머드체험! 국적이나 인종,언어,연령 등을 뛰어넘어 모두가 하나 되어 즐길 수 있는 체험형 여름축제이다.\n바다를 바라보며 머드를 온몸으로 느낄 수 있는 일반존과 온 가족이 함께 즐기는 패밀리존으로 구성되어 있다. 낮에는 머드를 흠뻑 적시며 시원하게 보낼 수 있고,\n밤에는 다양한 공연,불꽃쇼 등으로 낭만의 여름밤도 함께 즐길 수 있다.',NULL,'https://www.mudfestival.or.kr/festival/view','B6060','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681293718695\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681293718695\",\n		\"key\" : \"2ef2h\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-07-21','2023-08-06'),('축제','B61','대전/세종/충청','대백제전',5000,'금강신관공원','대전/세종/충청','23.09.23 - 23.10.09','<h1></h1>\n69년을 이어온 백제문화제는 고대 동아시아의 문화강국이었던 백제의 정통성에 근거하여 백제의 수도였던 충청남도 공주시와 부여군에서\n1955년부터 매년 개최하는 역사재현형 축제이다. 또한 2015년 7월 백제역사유적지구의 유네스코 세계유산 등재를 계기로 백제의 후예들과 관광객들이\n함께 만들어가는 세계적인 역사문화 축제로 나아가고 있다.<br><br>\n백제문화제는 백제 망국의 원혼을 위로하는 제의에서 시작된 조촐한 형태였지만, 전국에서 보기 드문 사례였기 때문에 부여군내는 물론 전국 각처에서 몰려든 관람객으로 인산인해를 이루었다고 한다.\n백제문화제는 해를 거듭하면서 제의적 성격으로부터 종합문화축제로서의 성격을 더해갔다. 우리나라의 전통적 축제는 전통사회의 붕괴와 일제강점기 식민통치로 인해 급격히 쇠퇴하였으나,\n1960년대 이후 전통문화의 부활이라는 의미로 향토축제가 만들어지기 시작하여 현재는 무려 886개의 지역축제가 개최되고 있다.',NULL,'https://www.baekje.org/kor/','B6161','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681294030671\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681294030671\",\n		\"key\" : \"2ef2i\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-09-23','2023-10-09'),('축제','B62','대전/세종/충청','천안흥타령춤축제',3000,'천안종합운동장','대전/세종/충청','23.06.21 - 23.06.25','\n<h1></h1>다 함께 흥겨운 춤을! 감동이 담긴 신나는 축제! 천안흥타령춤축제 입니다. <br>흥으로! 춤으로! 천안으로!\n다 함께 흥겨운 춤을!(Let’s Dance in Cheonan!)<br><br>\n천안의 흥타령 민요를 현대감각에 맞게 접목하여 다양한 춤과 음악으로 한데 어우러진 춤을 흥겹게 풀어내어\n신명, 감동, 화합의 한마당 축제의 장을 만들어 냅니다.\n성별, 연령 제한 없이 누구나 참여 가능한 춤 경연, 도심 한복판을 가로지르는 거대한 규모의 퍼레이드,\n세계 각국의 춤을 한자리에서 관람할 수 있는 국제춤대회 등 흥미로운 볼거리와 신나는 즐길 거리로\n방문객 여러분들께 흥겨운 경험과 즐거운 기억, 신나는 추억을 선사해드리겠습니다!!\n',NULL,'https://cheonanfestival.com','B0303','\n\n <!-- * 카카오맵 - 지도퍼가기 -->\n <!-- 1. 지도 노드 -->\n <div id=\"daumRoughmapContainer1679887184760\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n \n <!--\n 	2. 설치 스크립트\n 	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n -->\n <script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n \n <!-- 3. 실행 스크립트 -->\n <script charset=\"UTF-8\">\n 	new daum.roughmap.Lander({\n 		\"timestamp\" : \"1679887184760\",\n 		\"key\" : \"2e85a\",\n 		\"mapWidth\" : \"700\",\n 		\"mapHeight\" : \"330\"\n 	}).render();\n </script>\n',NULL,'2023-06-21','2023-06-25'),('축제','B63','대전/세종/충청','서산해미읍성한마당',1000,'해미읍성','대전/세종/충청','23.10.07 - 23.10.09','<h1></h1>\n서산해미읍성축제로 여러분을 초대합니다!<br>\n서산해미읍성축제는 방문객 모두가 나이와 성별, 국적과 인종을 불문하고 서산해미읍성이 품어온 축성 600년의 역사와\n우리나라의 고유한 전통·문화적 가치를 고스란히 이해하고 즐길 수 있도록 다양한 프로그램을 통해 이를 풀어내고자 합니다.\n태종대왕 행렬 및 강무(講武)재현, 역사마당극, 저잣거리 마당, 옥사체험, 숙영체험 등 기존에 인기를 끌었던 프로그램뿐만 아니라,\n금년도 제20회 축제를 맞아 새롭게 선보일 다채로운 신규프로그램을 통해 그동안 코로나-19로 인해 답답했던 일상에서 벗어나\n서산해미읍성 축성600년의 역사를 몸으로 직접 느끼고 배우는 즐거움을 여러분께 선사하고자 합니다.<br><br>\n2023년 10월, 청명한 가을하늘 아래서 사랑하는 가족· 연인·아이들과 함께 마음껏 뛰놀며 행복한 추억 만드시기 바랍니다!\n',NULL,'http://www.haemifest.com/','B6363','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681294433375\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681294433375\",\n		\"key\" : \"2ef2k\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-10-07','2023-10-09'),('축제','B64','대전/세종/충청','금산 세계 인삼 축ㅔ',1000,'금산세계인삼엑스포','대전/세종/충청','23.10.06 - 23.10.15','<h1></h1>\n1500여년의 역사를 자랑하는 고려인삼의 종주지, 충남 금산에서 강인한 에너지로 삶의 활력을 복돋아 주는 금산인삼축제가 매년 개최된다.\n해마다 최고의 인기를 자랑하는 체험의 진수 인삼캐기체험과 건강체험관, 인삼가공품을 저렴하게 구입할 수 있는 국제인삼교역전을 만나볼 수 있으며,\n평소 접하기 어려운 인삼전통 문화체험, 인삼에 로봇과 인공지능(AI)기술을 접목한 가족 참여 미래 콘텐츠도 재미를 더한다. <br><br>금산인삼축제는 문화체육관광부가 선정하는 전국 최우수축제 10회 선정,\n명예 문화관광축제 지정 등 명실 공히 한국을 대표하는 산업형 축제로 숱한 명성을 쌓아오고 있으며, 세계적인 축제로 발돋움하고 있다.\n',NULL,'http://www.insamfestival.co.kr/html/kr/sub2/sub2_020101.html','B6464','<!-- * 카카오맵 - 지도퍼가기 -->\n<!-- 1. 지도 노드 -->\n<div id=\"daumRoughmapContainer1681629543749\" class=\"root_daum_roughmap root_daum_roughmap_landing\"></div>\n\n<!--\n	2. 설치 스크립트\n	* 지도 퍼가기 서비스를 2개 이상 넣을 경우, 설치 스크립트는 하나만 삽입합니다.\n-->\n<script charset=\"UTF-8\" class=\"daum_roughmap_loader_script\" src=\"https://ssl.daumcdn.net/dmaps/map_js_init/roughmapLoader.js\"></script>\n\n<!-- 3. 실행 스크립트 -->\n<script charset=\"UTF-8\">\n	new daum.roughmap.Lander({\n		\"timestamp\" : \"1681629543749\",\n		\"key\" : \"2eg99\",\n		\"mapWidth\" : \"700\",\n		\"mapHeight\" : \"330\"\n	}).render();\n</script>',NULL,'2023-10-06','2023-10-09');
